<div dir=\"auto\" style=\"text-align: start;\">Vous souhaitez participer √† une foire pour exposer vos solutions, produits, services et activit√©s √† un large public compos√© de cadre d‚Äôentreprises, d‚Äôorganisations, de partenaires financiers, d‚Äô√©tudiants, d‚Äôinvestisseurs </div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\"><span class=\"pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu\"><br></span></div><div dir=\"auto\" style=\"text-align: start;\"><span class=\"pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu\"><br></span>Inscrivez-vous au plus tard le 10 novembre pour r√©server votre stand sur <span><a class=\"oajrlxb2 g5ia77u1 qu0x051f esr5mh6w e9989ue4 r7d6kgcz rq0escxv nhd2j8a9 nc684nl6 p7hjln8o kvgmc6g5 cxmmr5t8 oygrvhab hcukyx3x jb3vyjys rz4wbd8a qt6c0cv9 a8nywdso i1ao9s8h esuyzwwr f1sip0of lzcic4wl py34i1dx gpro0wi8\" href=\"https://vu.fr/AppelExposition?fbclid=IwAR08aXWRw3En510M18S14f7OpiBJF1fDd-lx0HxoFzRlG1bIXnfKcKftukY\" rel=\"nofollow noopener\" role=\"link\" tabindex=\"0\" target=\"_blank\">https://vu.fr/AppelExposition</a></span></div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\"><span></span><span><br></span></div></div></span></div></div></div></div>', 1, './storage/disk/activites/appel-a-ex_596739.webp', 85, 1, 1, '2021-10-29 09:59:59', '2022-12-09 22:59:46', NULL),
(3, 'Atelier de pr√©sentation des parcours de renforcement de capacit√©s des Structures d\'Accompagnement en Entreprenariat Innovant(SAEI)', 'atelier-de-presentation-des-parcours-de-renforcement-de-capacites-des-structures-daccompagnement-en-entreprenariat-innovantsaei', '-', 'Dans le cadre du projet DigiBoost, les SAEI ont √©t√© convi√©es dans les locaux de l\'H√¥tel Novotel du 14 au 15 Octobre 2021 par la faiti√®re des SAEI en Afrique d√©nomm√©e Afric\'Innov.', '<p>Nous avons particip√© du 14 au 15 Octobre 2021 dernier √† un Atelier organis√© par Afric\'Innov. Cet atelier entre dans le cadre du projet DigiBoost qui a pour objectif, la restructuration des Structures D‚ÄôAccompagnement √† l\'Entreprenariat Innovant (SAEI). Cet atelier a r√©uni une trentaine de SAEI venant des 4 coins du B√©nin. Odacesoft s\'est fait √©galement repr√©sent√© √† cet √©v√©nement. <br><br>Il √©tait question pour les participants de prendre connaissance des modules de renforcement de capacit√© pr√©vus dans le cahier de charges du projet, de faire des suggestions en fonction des difficult√©s rencontr√©s et des besoins sur le terrain.<br><br>La premi√®re journ√©e a √©t√© consacr√©e aux modules comp√©tences n√©cessaires au Charg√© de programme des SAEI et la Seconde journ√©e consacr√©e au fondateur des SAEI.<br><br>La prochaine √©tape consistera √† la s√©lection de 20 SAEI pouvant b√©n√©ficier de ce programme de formation pr√©vue pour d√©marrer en debut du mois de Novembre prochain.<br><br>Ce fut un atelier de partage et de collaboration tr√®s enrichissant. Ce projet vient √† point nomm√© dans une soci√©t√© o√π l\'accompagnement des jeunes entrepreneurs reste √† structurer afin que sortent de nos SAEI des Startups de renom.<br><br>C\'est l\'occasion pour de remercier Enabel et les autres partenaires techniques et financiers ainsi que l\'√©quipe de #DigiBoost, Afric\'Innov,... pour l\'effort qu\'ils fournissent chaque jour pour accompagner la professionnalisation des SAEI. <br><br>Les photos de cet atelier sont disponibles ici : <a href=\"https://flic.kr/s/aHsmWVx4qu\" target=\"_blank\">https://flic.kr/s/aHsmWVx4qu</a><br></p>', 1, './storage/disk/activites/atelier-de_582153.jpg', 50, 1, 1, '2021-10-29 11:41:22', '2022-11-26 09:13:37', NULL),
(4, 'S√©lection de jeunes Geeks (Developpeur, Electronicien, web designer, etc) A Parakou, Bohicon, Porto-Novo et Abomey-Calavi dans le cadre des R√©sidences Num√©rique', 'selection-de-jeunes-geeks-developpeur-electronicien-web-designer-etc-a-parakou-bohicon-porto-novo-et-abomey-calavi-dans-le-cadre-des-residences-numerique', '-', 'Dans le cadre des activit√©s des R√©sidences du Num√©rique, nous lan√ßon un appel √† s√©lection de jeunes geeks talentueux afin de faire valoir leurs comp√©tences au cours de cette activit√©.', '<p>Cette s√©lection de geeks s\'inscrit dans le cadre de l\'accompagnement des\n √©quipes candidates au challenge de solutions innovantes qui s\'organise \ndans le cadre des \'\'R√©sidences Numeriques\'\' 2√®me √©dition. <br><br>En \neffet, apr√®s une absence en 2020, en raison de la crise sanitaire, les \nr√©sidences num√©riques reviennent en 2021 dans plusieurs villes, avec la \ncollaboration de ODACE SOFT √† Parakou, SENS B√©nin, Hello booster et \nCarrefour lab √† Bohicon, √† Porto-Novo avec le LABIS Porto-Novo et √† \nCalavi avec Kolawol√© Photography.<br><br>Ouvert aux startup, \nentrepreneurs, women in Tech, geek, √©tudiants et √† toutes autres \npersonnes passionn√©es de l‚Äôentrepreneuriat et du num√©rique, les \nR√©sidences Num√©riques 2021 se veut des journ√©es de cr√©ation, d‚Äô√©changes,\n formation et de promotion de solutions innovantes port√©es par les \nstartups du B√©nin. Elles se tiendront √† Parakou du 11 au 13 novembre \n2021 ; Bohicon du 18 au 20 novembre 2021 ; √† Porto-Novo et Calavi du 25 \nau 27 novembre 2021.</p>', 1, './storage/disk/activites/selection-_209668.jpg', 44, 1, 1, '2021-10-29 11:58:50', '2022-12-06 00:09:04', NULL),
(5, 'Participation √† l\'atelier de pr√©sentation de la plateforme Digiboost.bj', 'participation-a-latelier-de-presentation-de-la-plateforme-digiboostbj', '-', 'Du 10 au 13 Octobre 2021, nous avons particip√© √† un atelier de  pr√©sentation et d‚Äôappropriation de la plateforme web DigiBoost. Cet atelier a eu lieu √†  GANNA H√¥tel situ√© √† Grand-Popo.', '<p>PARTICIPATION √Ä L\'ATELIER DE PR√âSENTATION DE LA PLATEFORME DIGIBOOST<br><br>&nbsp;<br><br>Pendant trois jours, nous avons pass√© en revu la nouvelle plate-forme mise en place par le projet #DigiBoost qui est un v√©ritable outil de suivi des actions men√©es par les Structures d\'Accompagnement √† l\'Entreprenariat Innovant (SAEI).&nbsp; C\'√©tait l\'occasion de d√©couvrir les diff√©rentes fonctionnalit√©s de cette plate-forme, notamment :<br><br>üí• Le processus de cr√©ation et de validation de compte &nbsp;<br><br>üí• Le processus de Cr√©ation et de Validation de SAEI, Startup,... <br><br>üí• La prise en main du tableau et le remplissage du profil des SAEI par l\'administrateur<br><br>üí• Le remplissage du profil de la SAEI <br><br>üí• La cr√©ation et la gestion des articles, des programmes, des projets, des √©v√©nements, des activit√©s, des formulaires,...<br><br>Plusieurs suggestions ont √©t√© soumis par les participants et ont ensuite √©t√© int√©gr√©es par l\'√©quipe technique de ITNum qui a eu la charge de d√©velopper cette plateforme. D\'autres suggestions sont √† int√©grer dans les prochains jours.<br><br>La plupart des SAEI pr√©sente ont cr√©√© un compte et rempli un certain nombre de donn√©es afin de permettre la mise en production de la plateforme avec des donn√©es r√©elles. <br><br>L\'√©quipe technique a pris la r√©solution de rester √† l\'√©coute de nouvelles suggestions afin de parfaire le travail afin de faire de cette plateforme un v√©ritable outil de travail et d\'accompagnement des structures d\'accompagnement au B√©nin et en Afrique.<br><br>Il faut rappeler que cette plateforme est d√©j√† h√©berg√© et disponible en ligne sur l\'URL: https://digiboost.bj<br><br>L\'atelier a pris fin, le Mercredi 13 Octobre aux environs de 14 par un des applaudissements √† l\'endroit du projet DigiBoost, de l\'√©quipe Technique et des B√©n√©ficiaires que constituent les SAEI suivi d\'une photo de Famille.<br><br>Les photos de l\'√©v√©nement sont disponibles ici :<br><a href=\"https://flic.kr/ps/3XAdBL\" target=\"_blank\">https://flic.kr/ps/3XAdBL</a><br><br>#Odacesoft #DigiBoost #Enabel #PlateformeDigiboost<br></p>', 1, './storage/disk/activites/participat_805252.webp', 70, 1, 1, '2021-10-29 12:18:48', '2022-12-04 06:35:09', NULL);
