(8, 'Participation de Odacesoft √† l\'atelier de restitution et d\'√©valuaion des programmes de formation en Anglais des SAEI', 'participation-de-odacesoft-a-latelier-de-restitution-et-devaluaion-des-programmes-de-formation-en-anglais-des-saei', '-', 'Odacesoft, repr√©sent√© par son fondateur monsieur Wilfried ETEKA a particip√© √† l\'atelier restitution du diagnostic et d\'√©valuation des programmes de formation en Anglais des SAEI', '<p><span class=\"d2edcug0 hpfvmrgz qv66sw1b c1et5uql lr9zc1uh a8c37x1j keod5gw0 nxhoafnm aigsh9s9 fe6kdd0r mau55g9w c8b282yb d3f4x2em iv3no6db jq4qci2q a3bd9o3v b1v8xokw oo9gr5id hzawbc8m\" dir=\"auto\"></span></p><div class=\"cxmmr5t8 oygrvhab hcukyx3x c1et5uql o9v6fnle ii04i59q\"><div dir=\"auto\" style=\"text-align: center;\"><b><i><br></i></b></div><div dir=\"auto\" style=\"text-align: start;\">Initi√©\n par dans le Cadre du projet DigiBoost, cet atelier&nbsp; a eu lieu √† \nGrand-Popo, du 7 au 9 D√©cembre 2021 et a pour objectif d\'√©valuer le \nbesoin des SAEI( Structures d\'Accompagnement √† l\'Entreprenariat \nInnovant) en terme d\'usage de la langue Anglaise en vue d\'√©laborer un \ncurricula qui permettra de mettre en ≈ìuvre le processus de formation des\n dirigeants de SAEI s√©lectionn√©s. </div></div><div class=\"cxmmr5t8 oygrvhab hcukyx3x c1et5uql o9v6fnle ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\">Une\n vingtaine de SAEI ont pris part √† cet √©v√©nement qui a permis dans un \npremier temps, d\'identifier les besoins des dirigeants et du personnel \ndes SAEI, de proposer un plan de formation et ensuite d\'√©tablir un \nChronogramme de d√©roulement de ce programme. Il faut noter que c\'est le \nCabinet LEARNING LAB qui a la charge de d√©rouler se programme de \nformation de 3 Cohortes qui va se d√©rouler sur neuf (9) mois √† raison de\n trois (3) mois par cohorte.</div><div dir=\"auto\" style=\"text-align: start;\"><br></div><div dir=\"auto\" style=\"text-align: start;\"> </div><div dir=\"auto\" style=\"text-align: start;\"><img src=\"data:image/jpeg;base64,\" style=\"width: 799px;\" data-filename=\"51736010772_a9a000ebf8_c.jpg\"></div><div dir=\"auto\" style=\"text-align: start;\"><br></div><div dir=\"auto\" style=\"text-align: start;\"><div dir=\"auto\" style=\"text-align: center;\"><span style=\"font-weight: bolder;\"><i>[Odacesoft repr√©sent√© par son Directeur au niveau de l\'atelier]</i></span></div><div dir=\"auto\"><br></div></div></div><div class=\"cxmmr5t8 oygrvhab hcukyx3x c1et5uql o9v6fnle ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\">La\n formation se d√©roulera en ligne via les plateformes de visioconf√©rence \nconnues (Zoom, Skype,...) √† raison de deux s√©ances par semaines avec des\n exercices quotidiens. </div></div><div class=\"cxmmr5t8 oygrvhab hcukyx3x c1et5uql o9v6fnle ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\">C\'√©tait\n l\'occasion aussi d\'initier les participants √† la phon√©tique des mots \nanglais, mais √©galement √† l\'initiation de conversations en vue de \nma√Ætrise cette langue qui deviendra dans les prochains mois, un outil de\n travail pour chaque structure d\'accompagnement. La premi√®re cohorte de \ncette formation d√©butera sa formation √† partir du 03 janvier 2022.</div><div dir=\"auto\" style=\"text-align: start;\"><br></div><div dir=\"auto\" style=\"text-align: start;\">Le contenu de la formation sera mis en ligne sur la plateforme <a href=\"http://www.digiboost.bj\" target=\"_blank\">www.digiboost.bj</a> qui regroupe tous les acteurs de √©cosyst√®me de l\'entreprenariat num√©rique au B√©nin. D√©couvre le les photos de l\'√©v√©nement ici : <span><a class=\"oajrlxb2 g5ia77u1 qu0x051f esr5mh6w e9989ue4 r7d6kgcz rq0escxv nhd2j8a9 nc684nl6 p7hjln8o kvgmc6g5 cxmmr5t8 oygrvhab hcukyx3x jb3vyjys rz4wbd8a qt6c0cv9 a8nywdso i1ao9s8h esuyzwwr f1sip0of lzcic4wl gpro0wi8 py34i1dx\" href=\"https://flic.kr/s/aHsmXey6zp?fbclid=IwAR0qYZs2VT6A76S-z_nZytfWf-7woEBkXAEa1AXV7rfKj5BLJng8qLemIWM\" rel=\"nofollow noopener\" r