(9, 'Participation effective de Odacesoft aux activit√©s de la deuxi√®me √©dition des R√©sidences Num√©riques', 'participation-effective-de-odacesoft-aux-activites-de-la-deuxieme-edition-des-residences-numeriques', '-', 'L\'√©v√©nement \"R√©sidences Num√©riques\" est un √©v√®nement national organis√© chaque ann√©e par Waxangari L@bs.', '<p><span class=\"d2edcug0 hpfvmrgz qv66sw1b c1et5uql lr9zc1uh a8c37x1j keod5gw0 nxhoafnm aigsh9s9 fe6kdd0r mau55g9w c8b282yb d3f4x2em iv3no6db jq4qci2q a3bd9o3v b1v8xokw oo9gr5id hzawbc8m\" dir=\"auto\">Cet √©v√©nement a pour objectif de promouvoir l\'entreprenariat innovant √† travers des s√©ances de partage, de formation, de cr√©ation et de challenges entre les porteurs de projets.<br></span></p><p><span class=\"d2edcug0 hpfvmrgz qv66sw1b c1et5uql lr9zc1uh a8c37x1j keod5gw0 nxhoafnm aigsh9s9 fe6kdd0r mau55g9w c8b282yb d3f4x2em iv3no6db jq4qci2q a3bd9o3v b1v8xokw oo9gr5id hzawbc8m\" dir=\"auto\">L‚Äôentrepreneuriat digital est au centre de la deuxi√®me journ√©e des R√©sidences Num√©riques.</span> La deuxi√®me √©dition a eu lieu dans 4 diff√©rentes villes du B√©nin :<br></p><p>‚úÖ Porto-Novo : du 25 au 27 Novembre 2021<br>Th√®me : Num√©rique, tourisme, industrie culturelles et cr√©atives.<br><br>‚úÖ Abomey-Calavi : du 25 au 27 Novembre 2021<br>Th√®me\n : L\'e-tourisme, les industries culturelles et cr√©atives: une \nopportunit√© pour la promotion culturelle, touristique et l\'employabilit√©\n des jeunes.<br><br>‚úÖ Bohicon : du 18 au 20 Novembre 2021<br>Th√®me : Exploiter le num√©rique pour transformer l\'agriculture et l\'employabilit√© des jeunes.</p><p><br>‚úÖ Parakou : du 2 au 4 D√©cembre 2021<br>Th√®me : L\'eco-tourisme/Culture et l\'e-agriculture : quelles opportunit√©s pour l\'employabilit√© des jeunes ?</p><p><br></p><p>Cet\n √©v√©nement a connu le soutien de plusieurs structures notamment parmi \nlesquels on peut citer : Solidarit√© La√Øque, Hello Booster, Guerra Tech \nHub, Light Innovation, Women In Tech B√©nin, Aide et Action, Labis, le \nCentre OUADADA, RADEB, la Mairie d\'Abomey-Calavi, Odacesoft, EtriLabs, \nKolawol√©Atcho Photographie, 2MG Consulting, L\'envol, MegaTech, \nFoodForAll, IA INNOV\'Activ, l\'universit√© d\'Abomey-Calavi, l\'universit√© \nde Parakou, la FNEB, LA FNEUP, L\'UNEUP, CARREFOUR LAB, FBC,... et \nplusieurs autres partenaires. Plusieurs entrepreneurs et porteurs de \nprojets ont √©galement particip√© au challenge organis√© au niveau de \nchaque ville afin de remporter les prix mis √† leur disposition.<br>Odacesoft\n a eu l\'occasion de participer aux activit√©s des R√©sidences Num√©riques \norganis√©es √† Parakou par la voix de son fondateur, monsieur Wilfried \nETEKA.<br>Il a fait partie des membres du jury qui ont jug√© de la \nqualit√© du travail effectu√© par les entrepreneurs et porteurs de \nprojets. Il a √©galement anim√© une Keynote sur la th√©matique \" Quelle \n√©ducation pour une vraie inclusion num√©rique \" et une formation sur \nFormation: \"comment cr√©er et d√©velopper une entreprise dans le domaine \ndu num√©rique.\"<br><br>Les diff√©rentes activit√©s de la deuxi√®me √©dition \ndes R√©sidences √©taient riches en sons et en couleurs, avec le soutien du\n projet DigiBoost mise en ≈ìuvre par Enabel, l\'agence fran√ßaise de \nd√©veloppement (AFD), l\'Union Europ√©enne et bien d\'autres partenaires.</p><p><br>#Odacesoft #ResidencesNumeriques #Entreprenariat #B√©ninNum√©rique</p><p></p>', 2, './storage/disk/activites/participat_577822.jpg', 68, 1, 1, '2021-12-19 09:00:39', '2022-12-12 20:53:19', NULL),
(10, 'Formation des administrateurs des administrateurs des r√©seaux sociaux sur le fact-checking √† Djougou et Bassila', 'formation-des-administrateurs-des-administrateurs-des-reseaux-sociaux-sur-le-fact-checking-a-djougou-et-bassila', '-', 'L\'ONG SIA N\'SON - DC √† initi√©  une s√©ance de communication  sur la vaccination contre  COVID-19 et le fact - Checking  √† l\'endroit des administrateurs de groupes WhatsApp dans les communes de Djougou et Bassila', '<p><p>\r\n\r\n</p><p class=\"MsoBodyText\" style=\"text-align:justify;text-justify:inter-ideograph;\r\ntext-indent:18.0pt\"><span style=\"mso-bidi-font-size:18.0pt;font-family:Montserrat;\r\nmso-bidi-font-weight:bold\">La pand√©mie li√©e au Covid-19 a connu depuis la fin\r\nde l‚Äôann√©e 2019, une mont√©e vertigineuse du nombre de cas d‚Äôabord dans la\r\npartie m√©ridionale du B√©nin avant de s‚Äô√©tendre dans les autres d√©partements du\r\npays. La flamb√©e du nombre de cas enregistr√©s dans les deux d√©partements. Il\r\ns‚Äôagit essentiellement de l‚Äôinstauration des gestes barri√®res en vue <b>de\r\nlimiter les contacts entre personnes</b>. Ainsi, plusieurs moyens ont √©t√© mis\r\nen branle pour r√©duire consid√©rablement les contacts. Au nombre de ceux-ci on\r\npeut citer par exemple <b>l‚Äôutilisation de l‚Äôinternet</b>. Avec l‚Äôinternet, les\r\nactivit√©s qui n√©cessitaient des regroupements de personnes sont rendues\r\npossibles gr√¢ce aux vid√©os conf√©rences par exemple.</span></p>\r\n\r\n<p class=\"MsoBodyText\" style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\"mso-bidi-font-size:18.0pt;font-family:Montserrat;mso-bidi-font-weight:\r\nbold\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoBodyText\" style=\"text-align:justify;text-justify:inter-ideograph;\r\ntext-indent:36.0pt\"><span style=\"mso-bidi-font-size:18.0pt;font-family:Montserrat;\r\nmso-bidi-font-weight:bold\">De nombreuses actions sont men√©es par nos\r\ngouvernants, les organisations de la soci√©t√© civile depuis l‚Äôann√©e 2020 afin de\r\njuguler cette pand√©mie. Pour se prot√©ger, le respect des gestes barri√®res et le\r\nchoix d‚Äôune vaccination sont offerts √† toute la population B√©ninoise. La\r\nvaccination est gratuite et accessible au plus de 18 ans. </span></p>\r\n\r\n<p class=\"MsoBodyText\" style=\"text-align:justify;text-justify:inter-ideograph;\r\ntext-indent:36.0pt\"><span style=\"mso-bidi-font-size:18.0pt;font-family:Montserrat;\r\nmso-bidi-font-weight:bold\">La propagation du coronavirus <i>SARS-CoV2 (</i>Covid-19)<i>\r\n</i>observ√©e dans le monde d√®s le d√©but 2020 a √©t√© accompagn√©e <b>d‚Äôune vague\r\nde d√©sinformation plan√©taire</b>. Une d√©sinformation qui passe majoritairement\r\npar les r√©seaux sociaux (Facebook, Groupe WhatsApp, Twitter, etc.)</span></p>\r\n\r\n<p class=\"MsoBodyText\" style=\"text-align:justify;text-justify:inter-ideograph\"><b><span style=\"mso-bidi-font-size:18.0pt;font-family:Montserrat\">Que savons-nous\r\naujourd‚Äôhui de cette masse de d√©sinformation&nbsp;?</span></b><span style=\"mso-bidi-font-size:18.0pt;font-family:Montserrat;mso-bidi-font-weight:\r\nbold\"> </span></p>\r\n\r\n<b><span style=\"font-size:11.0pt;mso-bidi-font-size:18.0pt;font-family:Montserrat;\r\nmso-fareast-font-family:Carlito;mso-bidi-font-family:Carlito;mso-ansi-language:\r\nFR;mso-fareast-language:EN-US;mso-bidi-language:AR-SA\">Que devons-nous faire\r\nafin de r√©duire cette vague de d√©sinformation&nbsp;? </span></b></p><p><b><span style=\"font-size:11.0pt;mso-bidi-font-size:18.0pt;font-family:Montserrat;\r\nmso-fareast-font-family:Carlito;mso-bidi-font-family:Carlito;mso-ansi-language:\r\nFR;mso-fareast-language:EN-US;mso-bidi-language:AR-SA\"><br></span></b></p><p><span style=\"font-size:11.0pt;mso-bidi-font-size:18.0pt;font-family:Montserrat;\r\nmso-fareast-font-family:Carlito;mso-bidi-font-family:Carlito;mso-ansi-language:\r\nFR;mso-fareast-language:EN-US;mso-bidi-language:AR-SA\">C\'est dans</span><span style=\"font-size:11.0pt;mso-bidi-font-size:18.0pt;font-family:Montserrat;\r\nmso-fareast-font-family:Carlito;mso-bidi-font-family:Carlito;mso-ansi-language:\r\nFR;mso-fareast-language:EN-US;mso-bidi-language:AR-SA\"> ce cadre que l\'ONG SIA N\'SONG a initi√© une s√©ance de sensibilisation sur la vaccination contre&nbsp; COVID-19 et le fact - Checking&nbsp; √† l\'endroit des administrateurs de groupes WhatsApp dans les communes de Djougou et Bassila.</span><b><span style=\"font-size:11.0pt;mso-bidi-font-size:18.0pt;font-family:Montserrat;\r\nmso-fareast-font-family:Carlito;mso-bidi-font-family:Carlito;mso-ansi-language:\r\nFR;mso-fareast-language:EN-US;mso-bidi-language:AR-SA\"><br></span></b><p><!--[if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  <w:TrackMoves/>\r\n  <w:TrackFormatting/>\r\n  <w:HyphenationZone>21</w:HyphenationZone>\r\n  <w:PunctuationKerning/>\r\n  <w:ValidateAgainstSchemas/>\r\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\r\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\r\n  <w:DoNotPromoteQF/>\r\n  <w:LidThemeOther>FR</w:LidThemeOther>\r\n  <w:LidThemeAsian>X-NONE</w:LidThemeAsian>\r\n  <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>\r\n  <w:Compatibility>\r\n   <w:BreakWrappedTables/>\r\n   <w:SnapToGridInCell/>\r\n   <w:WrapTextWithPunct/>\r\n   <w:UseAsianBreakRules/>\r\n   <w:DontGrowAutofit/>\r\n   <w:SplitPgBreakAndParaMark/>\r\n   <w:DontVertAlignCellWithSp/>\r\n   <w:DontBreakConstrainedForcedTables/>\r\n   <w:DontVertAlignInTxbx/>\r\n   <w:Word11KerningPairs/>\r\n   <w:CachedColBalance/>\r\n   <w:UseFELayout/>\r\n  </w:Compatibility>\r\n  <w:DoNotOptimizeForBrowser/>\r\n  <m:mathPr>\r\n   <m:mathFont m:val=\"Cambria Math\"/>\r\n   <m:brkBin m:val=\"before\"/>\r\n   <m:brkBinSub m:val=\"&#45;-\"/>\r\n   <m:smallFrac m:val=\"off\"/>\r\n   <m:dispDef/>\r\n   <m:lMargin m:val=\"0\"/>\r\n   <m:rMargin m:val=\"0\"/>\r\n   <m:defJc m:val=\"center