\"\r\n   UnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Book Title\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"37\" Name=\"Bibliography\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"39\" QFormat=\"true\" Name=\"TOC Heading\"/>\r\n </w:LatentStyles>\r\n</xml><![endif]--><!--[if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:\"Tableau Normal\";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-qformat:yes;\r\n	mso-style-parent:\"\";\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin:0cm;\r\n	mso-para-margin-bottom:.0001pt;\r\n	mso-pagination:widow-orphan;\r\n	font-size:10.0pt;\r\n	font-family:\"Times New Roman\",\"serif\";}\r\n</style>\r\n<![endif]--></p><p>Pendant toute la journ√©e du 14 D√©cembre 2021, les administrateurs des r√©seaux sociaux r√©sident dans la ville de Djougou et ses environs ont eu droit √† des panels de communication sur la vaccination contre la COVID-19, Cette communication a aussi port√© sur les attitudes √† avoir face aux rumeurs qui circulent √† propos de la vaccination contre la COVID-19, ses avantages, les types de vaccins disponibles et nombre de doses, le fondement de la fiche de consentement et le m√©canisme de compensation en cas d\'effet secondaire. La&nbsp; v√©rification de la v√©racit√© des informations qui circulent sur ces r√©seaux sociaux √©tait √©galement √† l\'ordre du jour. Ils √©taient une trentaine d\'administrateurs des r√©seaux sociaux √† participer √† cet atelier qui a eu lieu dans les locaux de de SIA N\'SONG- Djougou. </p><p><br>En effet, apr√®s l\'√©tape de Djougou, les administrations des r√©seaux sociaux de la ville de Bassila ont √©galement eu droit √† ces m√™mes Panels dans la journ√©e du 15 D√©cembre 2021 dernier. Une vingtaine d\'administrateurs de r√©seaux sociaux ont r√©pondu pr√©sent √† cette s√©ance de communication qui a eu lieu dans la salle num√©rique du CEG 1 Bassila.</p><p>C\'est gr√¢ce √† l\'expertise de Mr Wilfried ETEKA, fondateur de Odacesoft que ces administrateurs de r√©seaux sociaux ont eu droit aux outils n√©cessaires afin d\'identifier et de bannir les fake news de leurs diff√©rents r√©seaux en cette p√©riode de propagation de fausses nouvelle.<br></p><p><br>Le souhait des initiateurs de ce projets est d\'aider les administrateurs des groupes WhatsApp, Facebook et autres √† mieux comprendre les enjeux de la vaccination et √† disposer des outils n√©cessaires afin de mieux se d√©fendre face aux rumeurs qui circulent dans leurs groupes respectifs.<br></p></p>', 1, './storage/disk/activites/formation-_560648.jpeg', 66, 1, 1, '2021-12-19 09:09:00', '2022-12-12 15:40:42', NULL);
