(11, 'Promotion du num√©rique √† Parakou, l\'agence d\'ing√©nierie en informatique \"Odacesoft\" s\'installe √† Zongo', 'promotion-du-numerique-a-parakou-lagence-dingenierie-en-informatique-odacesoft-sinstalle-a-zongo', '-', 'Le lundi 17 Janvier √† 10 heures s\'est d√©roul√©e la c√©r√©monie d\'ouverture des nouveaux locaux de Odacesoft sise au quartier Zongo 2 √† Parakou. Ils √©taient une trentaine de participants √† prendre part √† cet √©v√©nement.', '<div class=\"\" dir=\"auto\"><div class=\"ecm0bbzt hv4rvrfc ihqw7lf3 dati1w0a\" data-ad-comet-preview=\"message\" data-ad-preview=\"message\" id=\"jsc_c_ew\"><div class=\"j83agx80 cbu4d94t ew0dbk1b irj2b8pg\"><div class=\"qzhwtbm6 knvmm38d\"><span class=\"d2edcug0 hpfvmrgz qv66sw1b c1et5uql lr9zc1uh a8c37x1j fe6kdd0r mau55g9w c8b282yb keod5gw0 nxhoafnm aigsh9s9 d3f4x2em iv3no6db jq4qci2q a3bd9o3v b1v8xokw oo9gr5id hzawbc8m\" dir=\"auto\"><div class=\"cxmmr5t8 oygrvhab hcukyx3x c1et5uql o9v6fnle ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\"><b>Un cadre id√©al de cr√©ation et d\'innovation pour les jeunes entrepreneurs du num√©rique</b></div></div><div class=\"cxmmr5t8 oygrvhab hcukyx3x c1et5uql o9v6fnle ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\">L\'agence d\'ing√©nierie en informatique \"Odacesoft\"  est r√©solument engag√©e √† apporter significativement sa touche pour la promotion du num√©rique dans la ville de Parakou. Ainsi, elle a d√©cid√© de la cr√©ation d\'un nouveau si√®ge au quartier Zongo, dans le troisi√®me arrondissement de la ville de Parakou et de ses environs afin de mieux servir les jeunes entrepreneurs dans ce domaine de grande port√©e. La c√©r√©monie symbolique d\'inauguration de ce nouveau si√®ge s\'est d√©roul√©e le mardi 18 janvier 2022 en pr√©sence du directeur de l\'Odacesoft Wilfried Et√®ka, des jeunes entrepreneurs et chefs d\'entreprise du num√©rique de la cit√© des Koburu.<b><br></b><br></div><div class=\"cxmmr5t8 oygrvhab hcukyx3x c1et5uql o9v6fnle ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\">Install√©e √† Zongo-2 dans le troisi√®me arrondissement de Parakou, plus pr√©cis√©ment au niveau de la premi√®re rue √† droite avant l\'ex classico en quittant le march√© Zongo, l\'agence d\'ing√©nierie en informatique \"odacesoft\" est sp√©cialis√©e dans le domaine du num√©rique notamment de la Technologie de l\'Information et de la Communication (Tic). Ainsi, elle offre plusieurs services du num√©rique √† la communaut√© dont entre autres, le d√©veloppement d\'applications ; l\'expertise et formation ainsi que la communication digitale.</div><div dir=\"auto\" style=\"text-align: start;\"><br></div></div></div></span><span class=\"d2edcug0 hpfvmrgz qv66sw1b c1et5uql lr9zc1uh a8c37x1j fe6kdd0r mau55g9w c8b282yb keod5gw0 nxhoafnm aigsh9s9 d3f4x2em iv3no6db jq4qci2q a3bd9o3v b1v8xokw oo9gr5id hzawbc8m\" dir=\"auto\"><div class=\"cxmmr5t8 oygrvhab hcukyx3x c1et5uql o9v6fnle ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\">Don intervention, le directeur Wilfried Et√®ka a fait savoir que l\'odacesoft est une agence qui offre un gamme de services aux jeunes entrepreneurs qui excellent dans les domaines du num√©rique. ¬´ Dans le domaine de l\'accompagnement des jeunes aux m√©tiers du num√©rique, nous avons un projet d√©nomm√© \"memory to statup\" qui est destin√© aux jeunes entrepreneurs principalement des √©tudiants qui sont en fin de formation et qui souhaitent s\'essayer dans l\'entrepreneuriat num√©rique ¬ª, a-t-il pr√©cis√© avant d\'ajouter que, ¬´ nous les accompagnons √† concr√©tiser leur r√™ve. Nous avons fait l\'exp√©rience l\'ann√©e derni√®re et nous sommes √† la deuxi√®me √©dition. Le concours est d√©j√† lanc√© et les candidats s\'inscrivent d√©j√†. Nous allons d√©marrer l\'incubation en f√©vrier prochain ¬ª.</div><div dir=\"auto\" style=\"text-align: start;\"><img src=\"data:image/jpeg;base64,\" style=\"width: 100%;\" data-filename=\"odacesoft-_562240.jpg\"><br></div><div dir=\"auto\" style=\"text-align: start;\"><span class=\"d2edcug0 hpfvmrgz qv66sw1b c1et5uql lr9zc1uh a8c37x1j fe6kdd0r mau55g9w c8b282yb keod5gw0 nxhoafnm aigsh9s9 d3f4x2em iv3no6db jq4qci2q a3bd9o3v b1v8xokw oo9gr5id hzawbc8m\" dir=\"auto\"><div class=\"cxmmr5t8 oygrvhab hcukyx3x c1et5uql o9v6fnle ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\"><br></div></div></span><span class=\"d2edcug0 hpfvmrgz qv66sw1b c1et5uql lr9zc1uh a8c37x1j fe6kdd0r mau55g9w c8b282yb keod5gw0 nxhoafnm aigsh9s9 d3f4x2em iv3no6db jq4qci2q a3bd9o3v b1v8xokw oo9gr5id hzawbc8m\" dir=\"auto\"><div class=\"cxmmr5t8 oygrvhab hcukyx3x c1et5uql o9v6fnle ii04i59q\"><div dir=\"auto\" align=\"center\"><b>[Photo de famille apr√®s la c√©r√©monie d\'ouverture]</b></div><div dir=\"auto\" align=\"center\"><b><br></b></div></div></span></div></div><div class=\"cxmmr5t8 oygrvhab hcukyx3x c1et5uql o9v6fnle ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\">Ainsi, l\'agence d\'ing√©nierie en informatique \"Odacesoft\" est un cadre id√©al de cr√©ation et d\'innovation pour les jeunes qui entreprennent dans les domaines du num√©rique qui leur permettra, sans doute, de s\'exceller dans ce secteur d\'activit√©s de l\'avenir. Alors, c\'est une opportunit√© √† saisir absolument. </div><div dir=\"auto\" style=\"text-align: start;\"><br></div></div><div class=\"cxmmr5t8 oygrvhab hcukyx3x c1et5uql o9v6fnle ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\"><b>Source: </b>Journal L\'Etudiant Noir, la plume au service de la communaut√©</div></div></span></div></div></div></div>', 2, './storage/disk/activites/promotion-_437112.jpg', 123, 1, 1, '2022-01-20 07:35:29', '2022-12-01 08:02:20', NULL);
