(12, 'Odacesoft, l\'agence d\'ing√©nierie en informatique ouvre les portes de ses nouveaux locaux √† Zongo', 'odacesoft-lagence-dingenierie-en-informatique-ouvre-les-portes-de-ses-nouveaux-locaux-a-zongo', '-', 'L\'agence d\'ing√©nierie en informatique, odacesoft ouvre les portes de ses nouveaux locaux √† Zongo-2 apr√®s avoir d√©m√©nag√© du quartier Gbira.', '<div class=\"\" dir=\"auto\"><div class=\"ecm0bbzt hv4rvrfc ihqw7lf3 dati1w0a\" data-ad-comet-preview=\"message\" data-ad-preview=\"message\" id=\"jsc_c_1h\"><div class=\"j83agx80 cbu4d94t ew0dbk1b irj2b8pg\"><div class=\"qzhwtbm6 knvmm38d\"><span class=\"d2edcug0 hpfvmrgz qv66sw1b c1et5uql lr9zc1uh a8c37x1j fe6kdd0r mau55g9w c8b282yb keod5gw0 nxhoafnm aigsh9s9 d3f4x2em iv3no6db jq4qci2q a3bd9o3v b1v8xokw oo9gr5id hzawbc8m\" dir=\"auto\"><div class=\"cxmmr5t8 oygrvhab hcukyx3x c1et5uql o9v6fnle ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\">La c√©r√©monie d\'inauguration a eu lieu ce mardi 18 janvier 2022, au si√®ge de l\'agence situ√©e dans √† Zongo-2 dans le troisi√®me arrondissement de Parakou, plus pr√©cis√©ment au niveau de la premi√®re rue √† droite avant l\'ex classico en quittant le march√© Zongo. </div><div dir=\"auto\" style=\"text-align: start;\"><br></div></div><div class=\"cxmmr5t8 oygrvhab hcukyx3x c1et5uql o9v6fnle ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\">Cette agence est sp√©cialis√©e dans le domaine du num√©rique notamment dans la Technologie de l\'Information et de la Communication (Tic). Elle offre plusieurs services aux populations de la cit√© des Kobourou et ses environs. Il s\'agit entre autres, des s√©vices en d√©veloppement d\'applications ; d\'expertise et formation ; communication digitale et bien d\'autres. </div><div dir=\"auto\" style=\"text-align: start;\"><br></div></div><div class=\"cxmmr5t8 oygrvhab hcukyx3x c1et5uql o9v6fnle ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\">Pour le directeur de odacesoft, Wilfried Et√®ka, outre les services offerts aux populations, son agence forme les jeunes en g√©n√©ral et les femmes en particulier dans les m√©tiers du num√©rique. <b>¬´ Dans le domaine de l\'accompagnement des jeunes aux m√©tiers du num√©rique, nous avons un projet d√©nomm√© \"memory to statup\" qui est destin√© aux jeunes entrepreneurs principalement des √©tudiants qui sont en fin de formation et qui souhaitent s\'essayer dans l\'entrepreneuriat num√©rique. Nous les accompagnons √† concr√©tiser leur r√™ve.</b></div><div dir=\"auto\" style=\"text-align: start;\"><b>Nous avons fait l\'exp√©rience l\'ann√©e derni√®re et nous sommes √† la deuxi√®me √©dition. Le concours est d√©j√† lanc√© et les candidats s\'inscrivent d√©j√†. Nous allons d√©marrer l\'incubation en f√©vrier prochain ¬ª</b>, a pr√©cis√© Wilfried Et√®ka. </div><div dir=\"auto\" style=\"text-align: start;\"><br></div></div><div class=\"cxmmr5t8 oygrvhab hcukyx3x c1et5uql o9v6fnle ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\">Il faut souligner que la c√©r√©monie d\'inauguration de l\'agence s\'est d√©roul√©e en pr√©sence des jeunes entrepreneurs et chefs d\'entreprise dans le domaine du num√©rique √† Parakou. Pour plus d\'informations sur les offres de services de l\'agence, contactez le +229 64 84 42 12 .</div></div><div class=\"cxmmr5t8 oygrvhab hcukyx3x c1et5uql o9v6fnle ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\"><br></div><div dir=\"auto\" style=\"text-align: start;\"><b>Source:</b> R√©daction Journal Ak√¥w√© <span class=\"pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu\"><img alt=\"‚úçÔ∏è\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t69/1.5/16/270d.png\" width=\"16\" height=\"16\"></span></div></div></span></div></div></div></div>', 2, './storage/disk/activites/odacesoft-_562240.jpg', 153, 1, 1, '2022-01-20 21:20:57', '2022-12-01 08:02:20', NULL),
(13, 'Participation de Odacesoft aux activit√©s de formation des responsables de programmes et les charg√©s d\'accompagnement organis√©es par Afric‚ÄôInnov', 'participation-de-odacesoft-aux-activites-de-formation-des-responsables-de-programmes-et-les-charges-daccompagnement-organisees-par-africinnov', '-', 'A travers le programme DIGIBOOST, Odacesoft b√©n√©ficie depuis l‚Äôann√©e 2021 d‚Äôune s√©rie de formations afin d‚Äôam√©liorer son programme d‚Äôaccompagnement d√©nomm√© Mmeory2Stratup.', '<p>\n\n</p>Les jeunes entreprises repr√©sentent une v√©ritable aubaine\npour la structuration et le fonctionnement d‚Äôun mod√®le de d√©veloppement durable\nde nos pays. L‚Äôenjeu national du d√©veloppement passe par la cr√©ation et\nl‚Äôaccompagnement d‚Äôentreprises innovantes. L‚Äô√©mergence de structures <span style=\"mso-spacerun:yes\">&nbsp;</span>l‚Äôaccompagnement telles que Odacesoft est un\nfacteur essentiel dans l‚Äôam√©lioration de la performance des entreprises b√©ninoises.\nToutefois, l‚Äôaccompagnement d‚Äôentreprises et d‚Äôentrepreneurs demeure un domaine\nscientifique et technique assez r√©cent en Afrique. Ce manque de comp√©tences\nconstitue un v√©ritable d√©fi pour les SAEI.\n\n<p><br></p><p class=\"MsoNormal\">Le programme de formation et de renforcement des capacit√©s\ndes SAEI b√©ninoises initi√©e conjointement par Enabel √† travers le programme Digiboost\net ex√©cut√© par Afric‚Äôinnov,<span style=\"mso-spacerun:yes\">&nbsp; </span>est une\nsolution √† l‚Äôam√©lioration du fonctionnement des SAEI et des capacit√©s de\ncelles-ci √† fournir des cadres efficaces pour le d√©veloppement des jeunes\nentreprises. </p>\n\n<p>C‚Äôest ainsi que du 10 au 14 Janvier dernier s‚Äôest tenue √†\nGranp-Popo, une formation destin√©e aux responsables de programmes et les\ncharg√©s d\'accompagnement. Cette formation a √©t√© organis√©e Afric‚ÄôInnov et a\nport√© sur les th√©matiques suivantes&nbsp;:</p><ul><li><b>Comment identifier, attirer et int√©grer des\nentrepreneurs dans sa SAEI&nbsp;?</b></li><li><span style=\"mso-ascii-font-family:Calibri;mso-fareast-font-family:Calibri;\nmso-hansi-font-family:Calibri;mso-bidi-font-family:Calibri;mso-bidi-font-weight:\nbold\"><span style=\"mso-list:Ignore\"><span style=\"font:7.0pt &quot;Times New Roman&quot;\"></span></span></span><b>Comment Structurer un programme\nd‚Äôaccompagnement&nbsp;?</b></li><li><b>Comment G√©rer l\'ex√©cution d\'un programme\nd\'accompagnement ?<br></b></li></ul>\n\n<p class=\"MsoNormal\">Les acquis de cette formation permettront √† coup s√ªr de\nr√©orienter les programmes <span style=\"mso-spacerun:yes\">&nbsp;</span>d‚Äôaccompagnement\nde Odacesoft et de fournir des services de qualit√© √† la hauteur des attentes\ndes porteurs de projets.</p>\n\n<!--[if gte mso 9]><xml>\n <w:WordDocument>\n  <w:View>Normal</w:View>\n  <w:Zoom>0</w:Zoom>\n  <w:TrackMoves/>\n  <w:TrackFormatting/>\n  <w:HyphenationZone>21</w:HyphenationZone>\n  <w:PunctuationKerning/>\n  <w:ValidateAgainstSchemas/>\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\n  <w:DoNotPromoteQF/>\n  <w:LidThemeOther>FR</w:LidThemeOther>\n  <w:LidThemeAsian>X-NONE</w:LidThemeAsian>\n  <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>\n  <w:Compatibility>\n   <w:BreakWrappedTables/>\n   <w:SnapToGridInCell/>\n   <w:WrapTextWithPunct/>\n   <w:UseAsianBreakRules/>\n   <w:DontGrowAutofit/>\n   <w:SplitPgBreakAndParaMark/>\n   <w:DontVertAlignCellWithSp/>\n   <w:DontBreakConstrainedForcedTables/>\n   <w:DontVertAlignInTxbx/>\n   <w:Word11KerningPairs/>\n   <w:CachedColBalance/>\n  </w:Compatibility>\n  <w:BrowserLevel>MicrosoftInternetExplorer4</w:BrowserLevel>\n  <m:mathPr>\n   <m:mathFont m:val=\"Cambria Math\"/>\n   <m:brkBin m:val=\"before\"/>\n   <m:brkBinSub m:val=\"&#45;-\"/>\n   <m:smallFrac m:val=\"off\"/>\n   <m:dispDef/>\n   <m:lMargin m:val=\"0\"/>\n   <m:rMargin m:val=\"0\"/>