(14, 'Participation √† l\'atelier des restructuration de la F√©d√©ration des Structures d‚ÄôAccompagnement √† l‚ÄôEntreprenariat Innovant du B√©nin', 'participation-a-latelier-des-restructuration-de-la-federation-des-structures-daccompagnement-a-lentreprenariat-innovant-du-benin', '-', 'Du Mercredi 2 au Vendredi 4 F√©vrier 2022 a eu lieu dans les locaux de ¬´ H√¥tel des Princes ¬ª un atelier portant sur la Restructuration de la F√©d√©ration des Structures d‚ÄôAccompagnement √† l‚ÄôEntreprenariat Innovant (SAEI) du B√©nin', '<p class=\"MsoNormal\" style=\"text-align:justify\"><span lang=\"EN-US\" style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;font-family:Montserrat\">Durant trois (03) jours, les Structures d‚ÄôAccompagnement √† l‚ÄôEntreprenariat Innovant (SAEI) du B√©nin se sont r√©unis √† Bohicon dans le cadre du proet DigiBoost, afin la mise en place d\'une √©quipe qui d√©sormais conduira toutes les activit√©s de l\'√©cosyst√®me.&nbsp;Les premi√®res journ√©es ont √©t√© consacr√©es √† la r√©daction des textes de la f√©d√©ration notamment\nsur la vision, la mission les objectifs, les valeurs et les r√®glements de la f√©d√©ration √†\nmettre en place. Les travaux de groupes ont permis d\'aboutir √†&nbsp; la\nr√©daction de ces statuts qui sont bas√©s des normes existantes. </span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span lang=\"EN-US\" style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;font-family:Montserrat\"><br></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span lang=\"EN-US\" style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;font-family:Montserrat\">Cette F√©d√©ration ste constitu√©e d‚Äôun Conseil d‚ÄôAdministration (compos√© de 7 membres),\nd‚Äôun Conseil se surveillance (constitu√© de 3 commissaires au compte) et d‚Äôune\nDirection ex√©cutive (constitu√©e au moins d‚Äôun Directeur Ex√©cutif et d‚Äôun\ncomptable).&nbsp; <o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-family: Mo