-bidi-font-size:11.0pt;font-family:Montserrat\">Plusieurs\nactivit√©s sont pr√©vues dans ce PTA au profit des SAEI membre de la f√©d√©ration\nen termes de renforcement de capacit√©, de mobilisation de ressources, de\nsynergie d‚Äôaction, etc.</span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span lang=\"EN-US\" style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;font-family:Montserrat\">C\'√©tait l\'occasion pour la Coordonatrice du projet DigiBoost de f√©liciter tous les participants pour avoir privil√©gi√© l‚Äôint√©r√™t du groupe au d√©triment de l‚Äôint√©r√™t personnel.&nbsp;&nbsp;</span><span style=\"font-family: Montserrat; font-size: 12pt;\">Elle a promis √™tre aux c√¥t√©s des SAEI afin d\'assainir l\'√©cosyst√®me des SAEI en R√©publique du B√©nin.</span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><br></p><p>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<!--[endif]--><span lang=\"EN-US\" style=\"font-size:12.0pt;mso-bidi-font-size:\n11.0pt;line-height:115%;font-family:Montserrat\"><o:p></o:p></span>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n</p><p class=\"MsoNormal\" style=\"text-align:justify\"><span lang=\"EN-US\" style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;font-family:Montserrat\">L‚Äôatelier\nde travail a pris fin aux environs de quinze heures avec une photo de famille √†\nla satisfaction de tous les participants.</span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span lang=\"EN-US\" style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;font-family:Montserrat\"><br></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span lang=\"EN-US\" style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;font-family:Montserrat\">D√©couvrez les photos de cet atelier √† travers ce lien:&nbsp;</span><span style=\"color: var(--blue-link); font-family: inherit; font-size: 15px; white-space: pre-wrap;\"><a href=\"https://flic.kr/s/aHBqjzBQij\" target=\"_blank\">https://flic.kr/s/aHBqjzBQij</a></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span lang=\"EN-US\" style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;font-family:Montserrat\"><o:p></o:p></span></p>', 2, './storage/disk/activites/participat_726676.jpg', 103, 1, 1, '2022-02-06 13:17:07', '2022-12-12 09:19:40', NULL);
