(15, 'Atelier de formation sur les proc√©dures de lev√©e de fonds, les services d‚Äôacc√©l√©ration et la mise en place d‚Äôun espace de Coworking', 'atelier-de-formation-sur-les-procedures-de-levee-de-fonds-les-services-dacceleration-et-la-mise-en-place-dun-espace-de-coworking', '-', 'Nous avons particip√© √† un Atelier de formation √† Grand-Popo, du 24 au 27 Janvier 2022 sur le renforcement des capacit√©s de l\'√©quipe technique  de notre structure d\'accompagnement', '<p class=\"MsoNormal\" style=\"text-align:justify\">Le d√©veloppement des jeunes\nentreprises est une √©tape primordiale dans la croissance durable des structures\nd‚Äôaccompagnement √† entreprenariat Innovant (SAEI). Apr√®s s‚Äô√™tre lanc√© et\nr√©alis√© des r√©sultats int√©ressant, la plupart des entreprises ont besoin d‚Äôun coup\nde main en mati√®re de financement mais √©galement en mati√®re d‚Äôorganisation du\nfonctionnement interne.</p><p class=\"MsoNormal\" style=\"text-align:justify\"><br></p><p class=\"MsoNormal\" style=\"text-align:justify\"> </p><p class=\"MsoNormal\" style=\"text-align:justify\">Le lancement des activit√©s est un\nindicateur de base de la bonne marche de toute entreprise qui souhaite grandir.\nLes SAEI, √† travers les espaces de travail partag√© (espace de coworking)\npermettent aux jeunes entrepreneurs de s‚Äôorganiser et de d√©marrer leurs projets\ndans de meilleurs conditions.</p><p class=\"MsoNormal\" style=\"text-align:justify\"><br></p><p class=\"MsoNormal\" style=\"text-align:justify\"><img src=\"data:image/jpeg;base64,\" style=\"width: 100%;\" data-filename=\"271663675_309131747910613_6306207989611270690_n.jpg\"><br></p><p class=\"MsoNormal\" style=\"text-align:justify\"> </p><p class=\"MsoNormal\" style=\"text-align: center;\"><b><i>[Photo de famille des participants]</i></b></p><p class=\"MsoNormal\" style=\"text-align:justify\"><br></p><p class=\"MsoNormal\" style=\"text-align:justify\">Etant donn√© que Odacesoft dispose\nd‚Äôun programme d‚Äôaccompagnement √† l‚Äôentreprenariat Innovant, il nous revient de\nfournir les meilleurs outils de travail aux incub√©s et entrepreneurs. Cela\nconstitue une garantie de productivit√© et de performance des entreprises\naccompagn√©es. C‚Äôest justement en ce sens qu‚Äô√† eu lieu √† Grand-Popo du 24 au 27\nJanvier 2022, un atelier de renforcement de capacit√© sur les services\nd‚Äôacc√©l√©ration et de lev√©e de fonds conjointement. Cet atelier est initi√© par\nle proejt Digiboost, finac√© par Enabel et assur√© de main de ma√Ætre par Afric‚Äôinnov.\nDeux membres de l‚Äô√©quipe de Odacesoft ont particip√© √† cet atelier . Il s‚Äôagit\nde&nbsp;:</p><p class=\"MsoNormal\" style=\"text-align:justify\"><br></p><p class=\"MsoListParagraphCxSpFirst\" style=\"text-align: justify; text-indent: -18pt; margin-left: 25px;\"><!--[if !supportLists]-->-<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\n</span><!--[endif]-->Ludovic BEKOU (Charg√© des Programme &amp;\nResponsable qualit√©) et </p><p class=\"MsoListParagraphCxSpLast\" style=\"text-align: justify; text-indent: -18pt; margin-left: 25px;\"><!--[if !supportLists]-->-<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\n</span><!--[endif]-->EKPALIGUIDIME Micha√´l M√©lias (Assistant du\nResponsable de l‚ÄôIncubation)</p><p class=\"MsoListParagraphCxSpLast\" style=\"text-align: justify; text-indent: -18pt; margin-left: 25px;\"><br></p><p class=\"MsoNormal\" style=\"text-align:justify\">Cet atelier est le deuxi√®me du\nprogramme de formation des responsables des SAEI b√©ninoises. Durant 3 jours de\nformations, √† la salle de conf√©rence de l‚ÄôH√¥tel Ganna de Grand-Popo, les\n√©quipes des SAEI du B√©nin ont √©t√© form√©s sur les proc√©dures de lev√©e de fonds,\nles services d‚Äôacc√©l√©ration et la mise en place d‚Äôun espace de Coworking. Les\nateliers ont √©t√© conduits par deux principaux intervenants ayant des\nexp√©riences accrues dans le secteur financier comme dans l‚Äôacc√©l√©ration\nd‚Äôentreprises. Dans une ambiance d√©contract√©e et surtout magistral, la cohorte\nde la cinquantaine d‚Äôacteurs de l‚Äôaccompagnement entrepreneurial au B√©nin ont\n√©t√© entretenus sur les proc√©dures de mobilisation de capitaux pour les jeunes\nentreprises ; et √©galement sur l‚Äôam√©lioration des services d‚Äôacc√©l√©ration\npropos√©s par les SAEI.</p><p class=\"MsoNormal\" style=\"text-align:justify\"><br></p><p class=\"MsoNormal\" style=\"text-align:justify\">Les principales comp√©tences\nacquises apr√®s l‚Äôatelier sont √©num√©r√©es ci-apr√®s : </p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\njustify\"><span style=\"font-family:Symbol;mso-ascii-font-family:Calibri;\nmso-ascii-theme-font:minor-latin;mso-hansi-font-family:Calibri;mso-hansi-theme-font:\nminor-latin;mso-char-type:symbol;mso-symbol-font-family:Symbol\">¬∑</span> Les\ndiff√©rentes formes de mobilisation de fonds et capitaux ; </p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\njustify\"><span style=\"font-family:Symbol;mso-ascii-font-family:Calibri;\nmso-ascii-theme-font:minor-latin;mso-hansi-font-family:Calibri;mso-hansi-theme-font:\nminor-latin;mso-char-type:symbol;mso-symbol-font-family:Symbol\">¬∑</span> Les\ndocuments essentiels dans un dossier de demande de financement ; </p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\njustify\"><span style=\"font-family:Symbol;mso-ascii-font-family:Calibri;\nmso-ascii-theme-font:minor-latin;mso-hansi-font-family:Calibri;mso-hansi-theme-font:\nminor-latin;mso-char-type:symbol;mso-symbol-font-family:Symbol\">¬∑</span> La\ntenue d‚Äôune comptabilit√© efficiente ; </p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\njustify\"><span style=\"font-family:Symbol;mso-ascii-font-family:Calibri;\nmso-ascii-theme-font:minor-latin;mso-hansi-font-family:Calibri;mso-hansi-theme-font:\nminor-latin;mso-char-type:symbol;mso-symbol-font-family:Symbol\">¬∑</span> Les\nstructures finan√ßant des entreprises africaines ; </p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\njustify\"><span style=\"font-family:Symbol;mso-ascii-font-family:Calibri;\nmso-ascii-theme-font:minor-latin;mso-hansi-font-family:Calibri;mso-hansi-theme-font:\nminor-latin;mso-char-type:symbol;mso-symbol-font-family:Symbol\">¬∑</span> Les\n√©l√©ments essentiels dans la construction d‚Äôun espace de coworking optimal ; </p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\njustify\"><span style=\"font-family:Symbol;mso-ascii-font-family:Calibri;\nmso-ascii-theme-font:minor-latin;mso-hansi-font-family:Calibri;mso-hansi-theme-font:\nminor-latin;mso-char-type:symbol;mso-symbol-font-family:Symbol\">¬∑</span> La\ntarification d‚Äôun espace de coworking ; </p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\njustify\"><span style=\"font-family:Symbol;mso-ascii-font-family:Calibri;\nmso-ascii-theme-font:minor-latin;mso-hansi-font-family:Calibri;mso-hansi-theme-font:\nminor-latin;mso-char-type:symbol;mso-symbol-font-family:Symbol\">¬∑</span>\nProposer des services pour rentabiliser une SAEI.</p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\njustify\"><br></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\njustify\"><img src=\"data:image/jpeg;base64,\" style=\"width: 100%;\" data-filename=\"272529382_4684721578242196_7475875376925265431_n.jpg\"><br></p><p>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n</p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\njustify\"><o:p>&nbsp;</o:p></p>', 3, './storage/disk/activites/atelier-de_725668.jpg', 65, 1, 1, '2022-02-12 23:57:27', '2022-11-29 22:33:04', NULL);
