(16, 'Deuxi√®me cohorte du programme d\'incubation Memory2Startup, la liste des projets s√©lectionn√©s disponible', 'deuxieme-cohorte-du-programme-dincubation-memory2startup-la-liste-des-projets-selectionnes-disponible', '-', 'Odacesoft √† travers son programme d\'incubation a lanc√© un appel √† projet pour la s√©lection des projets d\'entreprises. La liste des laur√©ats de la deui√®me cohorte est enfin disponible.', '<div dir=\"auto\"><font color=\"#050505\"><span style=\" white-space: pre-wrap;\">L‚Äôaccompagnement des jeunes entrepreuneurs a pour objectif d‚Äôanalyser d\'√™tre aux cot√©s des porteurs de projets afin les rendre performant et viable. Il s\'agit entre autre d\'√©liminer un maximum d\'incertitudes sur le mod√®le √©conomique afin de d√©-risquer le plus possible les projets entrepreneuriaux.\n\nLa finalit√© de l‚Äôincubation est bien entendu la commercialisation avec succ√®s des projets innovants, l‚Äôatteinte de l‚Äòind√©pendance financi√®re des startup et enfin, l‚Äôindustrialisation du produit ou service innovant (scalabilit√©). \n\nC\'est dans cette dynamique que Odacesoft s\'est lanc√© depuis l\'ann√©e derni√®re dans l\'Incubation de projets innovants avec pour objectif  </span><span style=\" white-space: pre-wrap; font-weight: bolder;\">\"Accompagner les jeunes dipl√¥m√©s √† mettre en place des entreprises viables √† fort impact au B√©nin\".</span><span style=\" white-space: pre-wrap;\">\n\nApr√®s plus de deux mois d\'appel √† projet, voici la liste des projets retenus  pour la phase d\'incubation :\n</span><span style=\" white-space: pre-wrap; font-weight: bolder;\">1- AGROBIOTOS : </span><span style=\" white-space: pre-wrap;\">Plateforme de formation, d\'accompagnement a l\'installation , appuis conseils et de suivi des fermes. \n</span><span style=\" white-space: pre-wrap; font-weight: bolder;\">2- SEDEWU : </span><span style=\" white-space: pre-wrap;\">Transformation et commercialisation de la tomate, du piment et de l\'ail en pur√©e ou concentr√©e bio.\n</span><span style=\" white-space: pre-wrap; font-weight: bolder;\">3- TIME KING :</span><span style=\" white-space: pre-wrap;\"> Syst√®me de gestion de pr√©sence au poste. \n</span><span style=\" white-space: pre-wrap; font-weight: bolder;\">4- FEEL GOOD : </span><span style=\" white-space: pre-wrap;\">Production et commercialisation de produits laitiers.\n</span><span style=\" white-space: pre-wrap; font-weight: bolder;\">5- Scanner 3D : </span><span style=\" white-space: pre-wrap;\">Conception et r√©alisation d\'un scanneur √©lectronique pour l\'acquisition de forme 3D\n</span><span style=\" white-space: pre-wrap; font-weight: bolder;\">6- B√©nin E-ticket :</span><span style=\" white-space: pre-wrap;\"> Plateforme de R√©servation de Tickets de voyage.\n</span><span style=\" white-space: pre-wrap; font-weight: bolder;\">7- INO AGENCY : </span><span style=\" white-space: pre-wrap;\">Mise en place portail num√©rique touristique et d\'un mus√© virtuel en 2D/3D\n\nC\'est le moment de remercier toute l\'√©quipe du comit√© de s√©lection et de ceux qui d\'une mani√®re ou d\'une autre contribue √† l\'accompagnement de nos initiatives. Nous disons f√©licitations aux laur√©ats et les exhortons √† se rendre disponible pour les prochaines √©tapes du processus d\'incubation.</span></font><span style=\"color: rgb(5, 5, 5); font-family: inherit;  white-space: pre-wrap;\">\n</span></div><div><br></div>', 2, './storage/disk/activites/deuxieme-c_504332.jpg', 45, 1, 1, '2022-02-16 23:00:34', '2022-10-13 07:59:43', NULL),
