(20, 'Les Wikip√©diens en collaboration avec Odacesoft, l\'association JeVeuxBriller et Shinenation organisent une formation sur la cr√©ation de contenus sur Wikip√©dia √† Parakou', 'les-wikipediens-en-collaboration-avec-odacesoft-lassociation-jeveuxbriller-et-shinenation-organisent-une-formation-sur-la-creation-de-contenus-sur-wikipedia-a-parakou', '-', 'Dans le cadre du mois international de la contribution 2022,  les Wikip√©diens rejoignent Parakou pour aider la communaut√© √† s\'approprier du Grand encyclop√©die qu\'est Wikip√©dia.', '<p>Les Wikip√©diens en collaboration avec Odacesoft, l\'association JeVeuxBriller et Shinenation&nbsp; organise :</p><p>‚úÖ LE MOIS INTERNATIONAL DE LA CONTRIBUTION 2022 AU B√âNIN üáßüáØ</p><p>A cet effet, une s√©ance de de formation sera organis√©e le 19 mars 2022 dans les locaux de Shinenation √† Parakou.</p><p>Rejoins-nous √† Parakou ce samedi 19 Mars 2022 pour apprendre et comprendre les coulisses de Wikip√©dia, l\'encyclop√©die collaborative.&nbsp;</p><p>Voici le lien d\'Inscription&nbsp;</p><p>üëâ https://bit.ly/3vVCTgA</p><p>‚úÖ La Date limite pour les inscriptions est fix√©e au 17 mars 2022 √† 23H 59.&nbsp;</p><p>Pour plus de renseignement, contactez par WhatsApp au num√©ro suivant :</p><p>‚òéÔ∏è http://wa.me/22997298054</p><p>P*artager avec vos contacts et amis.&nbsp;</p><p>#Odacesoft #Wikipedia #Wikimediens #Parakou</p>', 1, 'storage/uploads/activites/25451_1647707382_page.jpg', 12, 1, 1, '2022-03-19 15:29:42', '2022-11-07 09:04:45', NULL);
