(21, 'Visite du personnel de l\'Agence Belge pour le D√©veloppement Enabel dans nos locaux', 'visite-du-personnel-de-lagence-belge-pour-le-developpement-enabel-dans-nos-locaux', '-', 'Enabel est une organisation qui oeuvre au b√©nin dans plusieurs secteurs √† travers plusieurs projets. Dans le cadre du projet DigiBoost dont b√©n√©ficie Odacesoft, une visite a √©t√© effectu√©e ce Jeudi 17 Mars 2022', '<p>Nous avons re√ßu la visite dans la soir√©e du Jeudi 17 Mars dernier nos partenaires de l\'Agence Belge pour le d√©veloppement Enabel. Cette visite entre dans le cadre du Bilan des activit√©s du projet DigiBoost.</p><p><br></p><p>Nous avons eu des discussions autour du Projet #DigiBoost dont vous avons b√©n√©fici√© avec pour objectif de r√©v√©ler ce qui a le plus march√© et ensuite faire des observations dont il faut tenir compte √† l\'avenir.</p><p><br></p><p><img src=\"data:image/jpeg;base64,\" style=\"width: 100%;\" data-filename=\"275991006_1869929159858037_2121824275318921473_n.jpg\"><br></p><p>On a √©galement parl√© de comment Odacesoft pourrait d√©sormais se positionner afin de mettre son savoir faire √† la disposition de jeunes entrepreuneurs du B√©nin en g√©n√©ral et en particulier du Nord B√©nin.</p><p><br></p><p><a href=\"https://www.facebook.com/Odacesoft/\" target=\"_blank\">Rejoingnez nous sur facebook</a> et Abonnez-vous pour en savoir plus sur nos prochaines activit√©s.</p><div><br></div>', 2, 'storage/uploads/activites/29434_1647708202_page.jpg', 26, 1, 1, '2022-03-19 15:43:22', '2022-12-05 01:10:20', NULL);
