(22, 'Formation des Wikim√©diens √† Parakou, un paris gagn√© pour Odacesoft, Shinenation et l\'association #JEVEUXBRILLER', 'formation-des-wikimediens-a-parakou-un-paris-gagne-pour-odacesoft-shinenation-et-lassociation-jeveuxbriller', '-', 'Une formation sur la cr√©ation de contenus sur Wikip√©dia a √©t√© organis√©e √† Parakou le 19 Mars dernier dans les locaux de Shinenation. Plus de 20 participants ont r√©pondus pr√©sents √† ce rendez-vous.', '<p>A l‚Äôoccasion du mois international de la contribution 2022 au B√©nin, la communaut√© Wikim√©dienne a organis√© ce&nbsp; samedi 19 mars 2022 √† Parakou, un&nbsp; atelier de formation sur la cr√©ation de contenus sur Wikip√©dia en partenariat avec Odacesoft et d\'autres acteurs de l\'√©cosyst√®me Num√©rique de Parakou comme L\'association #JeVeuxBriller et #Shinnation. Une vinghtaine de participants&nbsp; ont particip√© √† la s√©ance&nbsp; de formation qui a eu lieu √† Shinnation et anim√©e par 04 formateurs.</p><p><br></p><p>Au cours de cette formations, plusieurs notions ont √©t√© apport√©es aux participants :&nbsp;</p><ul><li>Qu‚Äôest-ce que Wikip√©dia ;</li><li>les principes de Wikip√©dia ;</li><li>les projets neuf de Wikip√©dia et comment contribuer √† Wikip√©dia ;</li><li>Etc.</li></ul><p>Des exercices pratiques ont √©t√© attribu√© √† quelques participants vers la fin pour faire connaitre (par modification et ajout sur Wikip√©dia) certains quartiers de Parakou.</p><p><br></p><p>L‚Äôatelier a permis aux participants de pouvoir s‚Äôint√©resser √† ce r√©seau de contributeurs, amsi aussi pour d√©couvrir plusieurs fonctionnalit√©s du plus grand encyclop√©die libre que repr√©sente Wikip√©dia.</p><p><br></p><p><img src=\"data:image/jpeg;base64,\" style=\"width: 100%;\" data-filename=\"WhatsApp Image 2022-03-19 at 12.33.30 PM.jpeg\"><br></p><p><br></p><p> D√©sormais gr√¢ce √† l‚Äôatelier, Wikip√©dia ne sera plus consid√©r√© seulement\ncomme application de recherche d‚Äôinformation mais aussi comme une\noccasion de faire d√©couvrir au monde des choses sur mon Pays ou ma ville\nafin de contribuer √† Wikip√©dia . L\'essentiel a √©t√© donn√© aux participants afin d\'√™tre de v√©ritables contributeurs et ainsi √©viter certaines erreurs qui\npourraient facilement faire annuler leurs publications sur Wikip√©dia.</p><p>Des s√©ances de formations seront organis√©es dans les prochains mois afin de p√©r√©niser l\'acquis et de d√©velopper la communaut√© des Wikim√©diens dans la ville de Parakou.</p><p><br></p><p>Pour d√©buter votre aventure de contributeur sur Wikip√©dia cliquez ici :&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Aide:D√©buter\" target=\"_blank\">https://fr.wikipedia.org/wiki/Aide:D√©buter</a></p>', 3, 'storage/uploads/activites/61548_page.jpg', 67, 1, 1, '2022-03-21 14:57:08', '2022-12-11 09:17:23', NULL);
