(23, 'Participation au Camp d‚Äôimmersion de langue Anglaise √†  Bohicon du 20 au 25 Mars 2022', 'participation-au-camp-dimmersion-de-langue-anglaise-a-bohicon-du-20-au-25-mars-2022', '-', 'Nous avons particip√© du 20 au 25 Mars 2022 au Camp d‚Äôimmersion de langue Anglaise √†  Bohicon. Ce Camp a √©t√© organis√© par l‚ÄôAgence Belge pour le d√©veloppement Enabel et ex√©cut√© par Language Lab dans le cadre du projet Digiboost.', '<p>D√©marr√© le lundi 21 Mars 2022,&nbsp; les activit√©s du&nbsp;&nbsp;Camp d‚Äôimmersion de langue Anglaise<span \"=\"\">&nbsp;mission ont consist√© √†&nbsp;</span><span style=\"\">une s√©ance de valication de la plateforme de vulgarisation des structures d‚Äôaccompagnement √† l‚Äôentreprenariat innovant au B√©nin (www.digiboost.com) qui a eu lieu dans la journ√©e du 21 Mars 2022. Le reste des jjours de cet atelier a √©t√© consacr√© au&nbsp;</span>&nbsp;Camp d‚Äôimmersion de langue Anglaise.</p><p>C\'√©tait √† l‚ÄôH√¥tel ¬´ Le Prince ¬ª de Bohicon qu\'a lieu les&nbsp; 5 jours d\'activit√© de cet atelier. La<span style=\"font-family: var(--x-font-sans-serif); font-size: 1rem;\">&nbsp;plateforme valid√©e a √©t√© con√ßue l‚Äôann√©e derni√®re et avait re√ßue des suggestions et recommandations, lesquelles ont √©t√© prises en compte avant la pr√©sentation. Dans la soir√©e de ce Lundi 21 Mars, il a √©t√© demand√© aux participants de se connecter aux diff√©rents comptes afin de remplir les diff√©rentes informations relatives aux comptes cr√©es. Nous nous sommes donc connecter au compte Odacesoft afin de renseigner les informations n√©cessaires (logos, nom, devise, objectifs, mission, vision, etc.). Cette page est disponible √† l\'adresse suivante :&nbsp;</span><a href=\"https://digiboost.bj/fr/details-organisation?id=2LGQD3GErP\" target=\"_blank\">https://digiboost.bj/fr/details-organisation?id=2LGQD3GErP</a></p><p><span style=\"font-family: var(--x-font-sans-serif); font-size: 1rem;\"><br></span></p>\r\n<p>Les activit√©s du camp d‚ÄôAnglais ont proprement d√©marr√©es le lendemain √† partir de 9heures. Apr√®s une s√©ance de r√©vision, le reste des ateliers nous a permis d‚Äôaborder plusieurs notions √† travers :</p><p>-<span style=\"white-space:pre\">	</span>des tongues twisters (exercice de prononciation)</p><p>-<span style=\"white-space:pre\">	</span>les temps en Anglais (present simple/past simple, present perfect/past perfect, futur continuous/past continuous,‚Ä¶)</p><p>-<span style=\"white-space:pre\">	</span>Business English</p><p>-<span style=\"white-space:pre\">	</span>Singing (Chant)&nbsp;</p><p><br></p><p>Une √©valuation a √©t√© effectu√©e le troisi√®me jour (Jeudi 24 Mars) afin d‚Äô√©valuer le niveau des apprenants.&nbsp;</p><p>La matin√©e de la derni√®re journ√©e a √©t√© consacr√©e √† l‚Äôavis des participants sur la formation et √† des s√©ances de chant (singing).</p><p>Aux environs de 13 heures, la responsable du projet DigiBoost s‚Äôest exprim√©e par rapport au d√©roulement du camp et de l‚Äôactivit√© de la formation en g√©n√©rale. C‚Äô√©tait √©galement l‚Äôoccasion pour nous les participants de remercier Enabel et Language Lab pour l‚Äôeffort fourni afin que les structures d‚Äôaccompagnement puisse b√©n√©ficier de ce programme de langue qui sans doute a permis d‚Äôam√©liorer consid√©rablement le niveau de chaque participant en Anglais.</p><p>L‚Äôatelier de travail a pris fin aux environs de quatorze heures avec une photo de famille √† la grande satisfaction de tous les participants.</p><p>Les photos de l\'activit√©s sont disponibles ici :&nbsp;<a href=\"https://flic.kr/s/aHBqjzHjVE\" target=\"_blank\">https://flic.kr/s/aHBqjzHjVE</a><a href=\"https://flic.kr/s/aHBqjzHjVE\" target=\"_blank\"></a></p><p><br></p>\r\n<iframe frameborder=\"0\" allowfullscreen=\"\" class=\"flickr-embed-frame\" webkitallowfullscreen=\"\" mozallowfullscreen=\"\" oallowfullscreen=\"\" msallowfullscreen=\"\" width=\"1024\" height=\"768\" data-natural-width=\"1024\" data-natural-height=\"683\" style=\"overflow: hidden; padding: 0px; margin: 0px; width: 100%; height: 768px; max-width: none;\" data-loaded=\"true\"></iframe><script async=\"\" src=\"//embedr.flickr.com/assets/client-code.js\" charset=\"utf-8\"></script>', 3, 'storage/uploads/activites/15777_1648942096_page.jpg', 56, 1, 1, '2022-04-02 21:28:16', '2022-12-06 12:30:50', NULL);
