(24, 'Participation √† l\'atelier de validation de la feuille de route 2022-2023 de la F√©d√©ration des SAEI du Benin', 'participation-a-latelier-de-validation-de-la-feuille-de-route-2022-2023-de-la-federation-des-saei-du-benin', '-', 'Du Lundi 18 au Vendredi 22 Avril 2022, nous avons particip√© √† un atelier de travail √† Bohicon dans le cadre des activit√©s de F√©d√©ration des Structures d\'Accompagnement √† l\'Entreprenariat Innovants du B√©nin', '<p>D√©marr√© le Lundi aux environs de 9 heures, l\'atelier de travail inititi√© par la F√©d√©ration des SAEI (<span style=\"font-family: var(--x-font-sans-serif); font-size: 1rem;\">FedSAEI)&nbsp;</span><span style=\"font-family: var(--x-font-sans-serif); font-size: 1rem;\">et port√© par le Projet DibiBoost de Enabel B√©nin a permi aux acteurs de l\'√©cosyst√®me de l\'accompaganement en entreprenariat du B√©nin de mener un ensemble d\'activit√© afin de mettre en oeuvre leur programme de travail annuel.</span></p><p>Cet atelier&nbsp; regroupe environ 36 Structures d‚ÄôAccompagnement √† l‚ÄôEntrepreunariat Innovant (SAEI) r√©partis √† travers tout le B√©nin.&nbsp;<span style=\"font-family: var(--x-font-sans-serif); font-size: 1rem;\">L‚Äôobjectif de cet atelier est d‚Äô√©laborer une feuille de route annuelle 2022-2023 et d‚Äôapprouver la convention cadre entre la F√©d√©ration et DigiBoost.</span></p><p>Plus sp√©cifiquement, il est attendu lors de cet atelier les √©l√©ments suivants :&nbsp;</p><ul><li>D√©finir clairement les actions et activit√©s √† mener pour l‚Äôenregistrement officiel de la F√©d√©ration ;</li><li><span style=\"font-family: var(--x-font-sans-serif); font-size: 1rem;\">D√©cliner les actions, les responsables, le timing, activit√©s √† mener durant l‚Äôann√©e 2022 ;</span></li><li><span style=\"font-family: var(--x-font-sans-serif); font-size: 1rem;\">Amender et approuver la convention cadre FedSAEI et DigiBoost</span></li></ul><p><img src=\"data:image/jpeg;base64,\" style=\"width: 100%;\" data-filename=\"IMG-20220421-WA0063.jpg\"><br></p><p><br></p><p>Pr√©sid√© par le Bureau de la FedSAEI compos√©<span style=\"font-family: Montserrat; font-size: 12pt;\">&nbsp;de 7 membres du Conseil d‚ÄôAdministration (CA) et de 3\r\nCommissaires au compte, l\'atelier a permit au bout des 4 jours de travail d\'accoucher un PTA valid√© par l\'ensemble des acteurs pr√©sents apr√®s quelques amendements.</span></p><p><span style=\"font-family: Montserrat; font-size: 12pt;\">C\'√©tait aussi l\'occation pour la FedSAEI de discuter des enjeux du premier mandat qui sera d√©terminant dans l\'avenir des SAEI B√©ninoise.&nbsp;</span></p><p><span style=\"font-family: Montserrat; font-size: 12pt;\">Le FedSAEI a proit√© de l\'occasion pour proposer et adopter une convention de collaboration entre elle et DigiBoost.</span></p><div>Il faut rappeler que la s√©ance de travail au eu lieu √† l\'H√¥tel des Princes de Bohicon en pr√©sences des mebres de la FedSAEI et du projet DigiBoost.</div>', 3, 'storage/disk/activites/73847_1651345223_page.jpg', 21, 1, 1, '2022-04-30 17:00:23', '2022-11-11 16:03:29', NULL);
