(25, 'Forum sur l\'Intelligence Artificielle : Un pari gagn√© pour Odacesoft', 'forum-sur-lintelligence-artificielle-un-paris-gagne-pour-odacesoft', '-', 'Le forum sur l‚Äôintelligence artificielle org√©nis√© par Odacesoft s‚Äôest d√©roul√© du 27 au 28 mai 2022 dans les locaux de Odacesoft √† Parakou avec la participation de diff√©rents pays.', '<p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size: 18.6667px;\">Les deux journ√©es du Forum sur l\'Int√©lligence Artificielle ont permis aux participants d‚Äô√©changer et discuter sur leur exp√©riences et connaissances diverses dans leurs pratiques quotidiennes en ce qui concerne l‚Äôintelligence artificielle.&nbsp;</span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><br></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size: 18.6667px;\">L‚Äôobjectif du forum est de cr√©er un cadre d‚Äô√©change sur les enjeux et probl√©matiques li√©s √† l‚Äôintelligence artificielle et de mettre en place une communaut√© constitu√©e des passionn√©s de l‚ÄôIA.</span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><br></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size: 18.6667px;\">Les participants √† ce forum sont plus de 80 personnes ; de formation acad√©miques et exp√©riences professionnelles diff√©rentes. Certains d‚Äôentre eux sont √† leurs premi√®res exp√©riences en mati√®re d‚Äô√©change sur l‚Äôintelligence artificielle tandis que d‚Äôautres ont √©t√© d√©j√† impliqu√©s dans les r√©flexions sur l‚Äôintelligence artificielle. Tous les participants √©taient dans les dispositions d‚Äô√©changer et de d√©battre sur les outils et pratiques indispensables dans le d√©veloppement de l‚ÄôIA √† travers les technologies associ√©es (Machine Learning, Deep Learning, ‚Ä¶).</span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size: 18.6667px;\"><br></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size: 18.6667px;\">Au total 7 communications et une table ronde ont meubl√©es ces deux jours qu‚Äôa dur√© ce forum avec une implication, une participation dynamique et un int√©r√™t manifeste des participants. Il y a eu sur toutes les th√©matiques d√©velopp√©es beaucoup d‚Äô√©changes et de partages entre communicateurs et participants. La m√©thodologie d‚Äôapproche et la p√©dagogie utilis√©e pour v√©hiculer les informations sont simple et accessibles √† l‚Äôensemble des participants. Ces derniers n‚Äôont pas manqu√© √† poser d‚Äôailleurs beaucoup de questions qui ont suscit√© des d√©bats int√©ressants.</span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><img src=\"data:image/jpeg;base64,\" style=\"width: 100%;\" data-filename=\"WhatsApp Image 2022-05-30 at 8.48.17 PM.jpeg\"><br></p><p class=\"MsoNormal\" style=\"text-align: center;\"><span style=\"font-size: 18.6667px;\"><i>[Capture d\'√©cran de l\'une des communications en ligne]</i></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size: 18.6667px;\"><br></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size: 18.6667px;\">La clart√© des explications et les r√©p√©titions surtout au moment de la pr√©sentation de synth√®se de l‚Äô√©valuation journali√®re des activit√©s d√©roul√©es ont beaucoup facilit√© la compr√©hension et la maitrise des s√©ances. La synth√®se des diff√©rentes √©valuations confirme que les objectifs fix√©s dans le cadre de ce forum sont atteints, de m√™me que les attentes des participants sont couvertes et satisfaites.</span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size: 18.6667px;\"><br></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size: 18.6667px;\">A l‚Äôunanimit√©, tous les participants ont salu√© et approuv√© la d√©marche participative suscit√©e tout au long de l‚Äô√©v√®nement.</span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size: 18.6667px; font-family: var(--x-font-sans-serif);\">Plusieurs notions ont √©t√© donc apport√©es aux participants √† travers plusieurs communications dirig√© par des communicateurs sur les th√©matiques suivantes :</span><br></p><p class=\"MsoNormal\" style=\"text-align:justify\"><br></p><ul><li style=\"text-align: justify;\"><span style=\"font-size: 18.6667px;\"><b>Pr√©diction des d√©bits sur le bassin de l‚Äôou√©m√©, √† sav√® avec le deep learning</b> ; Communicateur : Pierre J√©r√¥me ZOHOU</span></li><li style=\"text-align: justify;\"><span style=\"font-size: 18.6667px;\"><b>Importance du Big Data pour r√©volutionner l‚ÄôIA en Afrique</b> ; Communicateur : Osias No√´l TOSSOU</span></li><li style=\"text-align: justify;\"><span style=\"font-size: 18.6667px;\"><b>Apprentissage automatique et diagnostique pr√©coces des maladies non transmissibles au B√©nin : cas des personnes √¢g√©es atteintes de l‚ÄôAVC</b> ; Communicateur : Mohamadou SALIFOU</span></li><li style=\"text-align: justify;\"><span style=\"font-size: 18.6667px;\">&nbsp;<b>L‚Äôintelligence artificielle au service de la mobilit√© urbaine au B√©nin</b> ; Communicateur : Bruno BIO NIKKI</span></li><li style=\"text-align: justify;\"><span style=\"font-size: 18.6667px;\"><b>L‚Äôintelligence artificielle au service du secteur de l‚Äôassurance</b> ; Communicateur : Brice OBOKINI &amp; Bernadin LIGAN</span></li><li style=\"text-align: justify;\"><span style=\"font-size: 18.6667px;\"><b>Outils et Techniques de cr√©ation d‚Äôun mod√®le de Maching Learning</b> ;Communicateur : Wahabou K. TABA CHABI</span></li><li style=\"text-align: justify;\"><span style=\"font-size: 18.6667px;\"><b>Intelligence Artificielle et le Machine Learning : Quelle B√©n√©fice pour l‚ÄôAgriculture</b> ; Communicateur : Aurel TCHOKPONHOUE &amp; D√©sir√© SIMPEREGUI</span></li><li style=\"text-align: justify;\"><span style=\"font-size: 18.6667px;\"><b>Table RONDE</b> : Quelle contribution de l‚ÄôIA au d√©veloppement √©conomique de l‚ÄôAfrique;&nbsp;</span>Invit√©s : Micka√´l MOUSSE, M. G√©raud AIHONNOU, Gilles ATIGOSSOU.</li></ul><p class=\"MsoListParagraphCxSpLast\" style=\"text-align:justify\"><span style=\"font-size:14.0pt;line-height:107%;mso-bidi-font-family:Calibri;\r\nmso-bidi-theme-font:minor-latin;color:black\">&nbsp;</span></p><table class=\"table table-bordered\"><tbody><tr><td><b>PAYS&nbsp; DES PARTICIPANTS</b></td><td><b>NOMBRE</b></td></tr><tr><td>B√©nin</td><td>70</td></tr><tr><td>Mali</td><td>2</td></tr><tr><td>S√©n√©gal</td><td>2</td></tr><tr><td>Ghana</td><td>1</td></tr><tr><td>Suisse</td><td>1</td></tr><tr><td>Maroc</td><td>4</td></tr><tr><td>Tchad</td><td>1</td></tr><tr><td>Cam√©roun</td><td>1</td></tr><tr><td>France</td><td>2</td></tr></tbody></table><p class=\"MsoListParagraphCxSpLast\" style=\"text-align:justify\"><span style=\"font-size: 18.6667px; font-family: Calibri, sans-serif;\"><br>L‚Äôindisponibilit√© de certains communicateurs et la coupure de l‚Äô√©lectricit√© n‚Äôont pas facilit√© les choses et ont entach√©s le bon d√©roulement des activit√©s. </span></p><p class=\"MsoListParagraphCxSpLast\" style=\"text-align:justify\"><span style=\"font-size: 18.6667px; font-family: Calibri, sans-serif;\"><br></span></p><p class=\"MsoListParagraphCxSpLast\" style=\"text-align:justify\"><span style=\"font-size: 18.6667px; font-family: Calibri, sans-serif;\">Cependant, la participation active et l‚Äôambiance conviviale et tr√®s chaleureuse not√©es pendant les diff√©rentes communications, montrent clairement le grand int√©r√™t que les participants portaient √† ce forum. La majorit√© des participants se dit satisfaite des s√©ances dans la mesure o√π elle a trait√© leurs attentes et a permis d‚Äô√©changer sur diff√©rentes th√©matiques. </span></p><p class=\"MsoListParagraphCxSpLast\" style=\"text-align:justify\"><span style=\"font-size: 18.6667px; font-family: Calibri, sans-serif;\">Les participants ont souhait√© que cette occasion soit mise en valeur d‚Äôavantage et soient organis√©es souvent des formations de ce genre pour partager les outils.</span><br></p><p class=\"MsoNormal\"><span style=\"font-size:14.0pt;line-height:107%;mso-bidi-font-family:\r\nCalibri;mso-bidi-theme-font:minor-latin\">&nbsp;</span></p>', 4, 'storage/disk/activites/80803_1654079977_page.jpg', 65, 1, 1, '2022-06-01 08:39:37', '2022-12-01 01:34:00', NULL);

