(1, 'Comment cr√©er sa Startup ?', 'comment-creer-sa-startup', '-', '-', '<div class=\"\" dir=\"auto\"><div class=\"ecm0bbzt hv4rvrfc ihqw7lf3 dati1w0a\" data-ad-comet-preview=\"message\" data-ad-preview=\"message\" id=\"jsc_c_1j\"><div class=\"j83agx80 cbu4d94t ew0dbk1b irj2b8pg\"><div class=\"qzhwtbm6 knvmm38d\"><span class=\"d2edcug0 hpfvmrgz qv66sw1b c1et5uql lr9zc1uh a8c37x1j keod5gw0 nxhoafnm aigsh9s9 d3f4x2em fe6kdd0r mau55g9w c8b282yb iv3no6db jq4qci2q a3bd9o3v b1v8xokw oo9gr5id hzawbc8m\" dir=\"auto\"><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\">Se lancer dans l\'entreprenariat doit √™tre une d√©cision bien m√ªrie. On ne na√Æt pas entrepreneur, on le devient. </div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\">Pour\r\n entreprendre, vous devez vous conna√Ætre, vos points forts et vos points\r\n faibles. Il est bien plus facile de se lancer dans un domaine que nous \r\nma√Ætrisons ou qui est adapt√© √† nos points forts que de se lancer dans \r\nquelque chose que vous ne maitrisez pas du tout. C‚Äôest pour cela que je \r\nvais vous demander de lister toutes vos comp√©tences sur un papier, que \r\nce soit des comp√©tences techniques, manag√©riales, sociales, etc.</div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\">Il faut ensuite vous poser les bonnes questions: pourquoi souhaitez vous entreprendre ?</div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\">La r√©ponse √† cette question vous aidera tout au long de votre parcours d‚Äôentrepreneur.</div><div dir=\"auto\" style=\"text-align: start;\">En\r\n plus de cette question, vous devez √™tre pr√™t psychologiquement √† \r\naffronter vos peurs et √† tout donner afin de combler les aspects dans \r\nlesquels vous ne vous sentez pas trop dou√© et qui vous aideront √† √™tre \r\nun bon entrepreneur.</div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\"><span class=\"pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu\"><img alt=\"üí•\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t40/1/16/1f4a5.png\" width=\"16\" height=\"16\"></span> CHOISISSEZ UN DOMAINE PORTEUR D‚ÄôAVENIR </div><div dir=\"auto\" style=\"text-align: start;\">√ätre\r\n entrepreneur, c‚Äôest √™tre √† l\'aff√ªt de l‚Äôinformation, du besoins qu‚Äôil \r\npeut y avoir dans votre environnement afin d‚Äôy apporter une solution. \r\nS‚Äôil existe une solution que les gens pensent √™tre meilleure, c‚Äôest √† \r\nvous de penser au-del√† pour prouver qu‚Äôon peut faire mieux. C‚Äôest de l√† \r\nque na√Æt l‚Äôinnovation. </div><div dir=\"auto\" style=\"text-align: start;\">√ätre\r\n √† l\'aff√ªt de l‚Äôinformation, c‚Äôest aussi savoir ce qui va demain √™tre \r\nutile ou √† la mode, c‚Äôest de voir demain avant qu‚Äôil n‚Äôarrive, c‚Äôest \r\npr√©voir une solution √† un probl√®me imminent ou futur.</div><div dir=\"auto\" style=\"text-align: start;\">√âtant\r\n donn√© que vous connaissez vos points forts et vos points faibles, il \r\nvous faut vous tourner vers un domaine qui cadre avec vos points forts \r\net plus sp√©cifiquement sur un domaine sp√©cifique dans lequel vous \r\nsouhaitez avoir une expertise afin de r√©soudre les probl√®mes qui se \r\npr√©senteront sur votre chemin.</div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\"><span class=\"pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu\"><img alt=\"üí•\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t40/1/16/1f4a5.png\" width=\"16\" height=\"16\"></span> TROUVEZ L\'ID√âE DU SI√àCLE </div><div dir=\"auto\" style=\"text-align: start;\">Avant\r\n d‚Äô√™tre un entrepreneur, vous √™tes un consommateur des produits des \r\nautres entrepreneurs. Votre insatisfaction par rapport √† un ou plusieurs\r\n de ces produits peut constituer un projet ou une id√©e de startup √† \r\nm√ªrir. Vous pouvez vous poser la question de savoir pourquoi vous \r\nchoisiriez tel produit au lieu de tel autre?</div><div dir=\"auto\" style=\"text-align: start;\">Partout\r\n o√π vous avez, des id√©es peuvent vous venir √† la t√™te, je vous conseille\r\n d‚Äôavoir un carnet afin de noter tout ce qui pourrait vous passer √† la \r\nt√™te comme id√©e de projet.</div><div dir=\"auto\" style=\"text-align: start;\">Vous\r\n pourrez au calme faire une √©limination afin de retenir celui qui selon \r\nvous respecte les crit√®res de startup dont nous avons parl√© que sont:</div><div dir=\"auto\" style=\"text-align: start;\"><span class=\"pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu\"><img alt=\"‚úÖ\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" width=\"16\" height=\"16\"></span> l‚Äôinnovation</div><div dir=\"auto\" style=\"text-align: start;\"><span class=\"pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu\"><img alt=\"‚úÖ\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" width=\"16\" height=\"16\"></span> la perspective d‚Äôune forte croissance</div><div dir=\"auto\" style=\"text-align: start;\"><span class=\"pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu\"><img alt=\"‚úÖ\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" width=\"16\" height=\"16\"></span> la cr√©ation ou l\'utilisation d\'une technologie nouvelle</div><div dir=\"auto\" style=\"text-align: start;\"><span class=\"pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu\"><img alt=\"‚úÖ\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" width=\"16\" height=\"16\"></span> le besoin d\'un financement massif</div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\"><span class=\"pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu\"><img alt=\"üí•\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t40/1/16/1f4a5.png\" width=\"16\" height=\"16\"></span>TESTEZ VOS ID√âES </div><div dir=\"auto\" style=\"text-align: start;\">Une\r\n fois l‚Äôid√©e trouv√©e, il vous faut la tester aupr√®s de votre client√®le \r\nou √† travers des appels √† projet afin de juger de l‚Äôimportance ou de \r\nl‚Äôacceptation de ce dernier aupr√®s de votre client√®le ou du public \r\ncible. C‚Äôest donc le moment de r√©aliser un mockup (ou prototype) afin \r\nd‚Äôavoir un aper√ßu sur ce √† quoi pourrait ressembler votre produit final.\r\n Vous pouvez √©galement r√©aliser des enqu√™tes afin d‚Äôavoir l‚Äôavis des uns\r\n et des autres sur votre projet. Vous devez savoir qu‚Äôune id√©e ne vaut \r\nrien si elle ne sert √† personne.</div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\"><span class=\"pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu\"><img alt=\"üí•\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t40/1/16/1f4a5.png\" width=\"16\" height=\"16\"></span> LANCEZ VOUS </div><div dir=\"auto\" style=\"text-align: start;\">On\r\n n\'est jamais pr√™t pour d√©marrer une affaire. On se lance dans les \r\naffaires pour r√©soudre des probl√®mes et aussi pour se faire de l‚Äôargent \r\nsi votre id√©e semble √™tre g√©niale et qu‚Äôelle ne vous permettra pas dans \r\nle long terme de gagner de l‚Äôargent, il va falloir encore y penser avant\r\n de vous lancer.</div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\">La grande question qu\'on se pose souvent est de savoir comment avoir mon premier produit et g√©n√©rer mes premiers revenus ?</div><div dir=\"auto\" style=\"text-align: start;\">Si\r\n vous arrivez √† r√©soudre ce challenge, il suffira de se donner de \r\nnouveaux challenges chaque jour afin de faire grandir votre entreprise.</div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\">Pour\r\n partager les risques, certains recommandent de se lancer √† plusieurs \r\nafin que vous soyez √©paul√© par vos coll√®gues afin de relever les d√©fis \r\nqui se pr√©senteront sur votre chemin.</div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\">On\r\n peut devenir riche en entreprenant mais on entreprend pas parce qu\'on \r\nveut devenir riche rapidement. C‚Äôest une d√©cision √† m√ªrir avant de s‚Äôy \r\nlancer.</div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\">Et vous, √™tes vous pr√™t pour lancer votre startup ?</div><div dir=\"auto\" style=\"text-align: start;\">Dites moi, √† quelle √©tape √™tes vous et comment pourrais- je vous aider.</div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\"><span></span><span><br></span></div></div></span></div></div></div></div>', '-', NULL, 11, 1, 1, 1, 1, '2021-10-29 06:26:52', '2022-10-25 16:28:18', NULL),
(2, 'C\'est quoi une Startup ?', 'cest-quoi-une-startup', '-', '-', '<div dir=\"auto\" style=\"text-align: start;\">Aujourd‚Äôhui, nous allons parler d‚Äôun mot dont vous avez certainement entendu parler une, deux ou plusieurs fois.</div><div dir=\"auto\" style=\"text-align: start;\">De quoi parle ton quand on parle de Startup.</div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\"><span class=\"pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu\"><img alt=\"üí•\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t99/1.5/16/1f4a5.png\" width=\"16\" height=\"16\"></span> L‚ÄôORIGINE DU MOT</div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\">Une start-up encore appel√©e jeune pousse ou entreprise en d√©marrage. En d\'autres termes, c\'est une entreprise innovante nouvellement cr√©√©e, g√©n√©ralement √† la recherche d\'importants fonds d\'investissement, avec un tr√®s fort potentiel √©ventuel de croissance √©conomique et de sp√©culation financi√®re sur sa valeur future. (Wikip√©dia)</div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\"><span class=\"pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu\"><img alt=\"üí•\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t99/1.5/16/1f4a5.png\" width=\"16\" height=\"16\"></span> DE QUOI S\'AGIT IL, DANS LA PRATIQUE ? </div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\">Dans la pratique, une Startup est une entreprise. Mais pas une entreprise √† part enti√®re. Il s‚Äôagit d‚Äôune \"entreprise qui d√©marre\". Elle est li√©e √† la notion d‚Äôexp√©rimentation d\'une nouvelle activit√©, sur un nouveau march√©, avec un risque difficile √† √©valuer.  Ces types d‚Äôentreprises sont souvent √† la recherche d‚Äôun business Mod√®le, c\'est-√† -dire un moyen de g√©n√©rer de l‚Äôargent avec leurs activit√©s actuelles.</div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\"><span class=\"pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu\"><img alt=\"üí•\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t99/1.5/16/1f4a5.png\" width=\"16\" height=\"16\"></span> CRIT√àRES √Ä REMPLIR POUR √äTRE UNE STARTUP </div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\">Il doit remplir selon sa d√©finition un certain nombre de crit√®res:</div><div dir=\"auto\" style=\"text-align: start;\"><span class=\"pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu\"><img alt=\"‚úÖ\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tba/1.5/16/2705.png\" width=\"16\" height=\"16\"></span> l‚Äôinnovation</div><div dir=\"auto\" style=\"text-align: start;\"><span class=\"pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu\"><img alt=\"‚úÖ\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tba/1.5/16/2705.png\" width=\"16\" height=\"16\"></span> la perspective d‚Äôune forte croissance</div><div dir=\"auto\" style=\"text-align: start;\"><span class=\"pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu\"><img alt=\"‚úÖ\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tba/1.5/16/2705.png\" width=\"16\" height=\"16\"></span> la cr√©ation ou l\'utilisation d\'une technologie nouvelle</div><div dir=\"auto\" style=\"text-align: start;\"><span class=\"pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu\"><img alt=\"‚úÖ\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tba/1.5/16/2705.png\" width=\"16\" height=\"16\"></span> le besoin d\'un financement massif</div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\"><span class=\"pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu\"><img alt=\"üí•\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t99/1.5/16/1f4a5.png\" width=\"16\" height=\"16\"></span> UNE STARTUP, UNE ENTREPRISE FRAGILE</div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\">Le caract√®re innovant sur lequel se base l‚Äôoffre de la startup et  son mod√®le √©conomique(sa fa√ßon de gagner de l‚Äôargent) ne permet pas de d√©finir clairement toutes les composantes de son march√© et de lui assurer une rentabilit√© imm√©diate. C‚Äôest pour cela qu‚Äôon parle de risque √©lev√©. Cela veut dire qu‚Äôau cours de la phase d‚Äôexp√©rimentation, l‚Äôentreprise peut faire faillite et abandonner le projet.</div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\">Au terme de la phase d‚Äôexp√©rimentation, la startup :</div><div dir=\"auto\" style=\"text-align: start;\"><span class=\"pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu\"><img alt=\"‚≠ï\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tc0/1.5/16/2b55.png\" width=\"16\" height=\"16\"></span> devient une entreprise traditionnelle avec un mod√®le √©conomique √©tabli (Google, Facebook, AirBnb,GoZem,...)</div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\"><span class=\"pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu\"><img alt=\"‚≠ï\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tc0/1.5/16/2b55.png\" width=\"16\" height=\"16\"></span> ou est absorb√©e par une entreprise plus grande(c‚Äôest le cas de plusieurs entreprises: WhatsApps et Instagram tous rachet√©s par Facebook, LinkedIn rachet√© par Microsoft, Twitch rachet√© par Amazone, ‚Ä¶)</div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\"><span class=\"pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu\"><img alt=\"‚≠ï\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tc0/1.5/16/2b55.png\" width=\"16\" height=\"16\"></span> ou dispara√Æt par manque de tr√©sorerie (Faillite).</div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\"><span class=\"pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu\"><img alt=\"üí•\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t99/1.5/16/1f4a5.png\" width=\"16\" height=\"16\"></span> COMMENT LANCER MA STARTUP ? </div><div dir=\"auto\" style=\"text-align: start;\">Souhaitez-vous lancer une startup, si la r√©ponse est OUI, nous allons d√©couvrir demain comment le faire.</div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\">Excellente nuit √† tous.</div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\"><span><br></span></div></div>', '-', NULL, 38, 1, 1, 1, 1, '2021-10-29 07:42:33', '2022-12-07 20:49:27', NULL);

