(6, 'Projet de Donn√©es ouvertes des villes du B√©nin - City Open Data', 'projet-de-donnees-ouvertes-des-villes-du-benin-city-open-data', 'Ce projet vise √† collecter et rendre accessibles certaines donn√©es utiles pour la population. L‚Äôobjectif pour le long terme de disposer des donn√©es fiables pouvant service √† une int√©lligence collective.', 0, 'Le programme City Open Data est encore √† sa phase B√™ta. La collecte des donn√©es est en cours et une plateforme sera mise √† disposition dans l\'avenir pour rendre public ces donn√©es.<br>', 'storage/disk/programmes/img_677520.jpg', NULL, 1, NULL, 1, '2022-01-26 09:54:42', '2022-01-26 09:54:42', NULL);

