(2, 'R√©alisation de visuels sur les cittations de motivation populaires', 'realisation-de-visuels-sur-les-cittations-de-motivation-populaires', 'Nous n\'avons pas tout le temps le moral √† 100%. C\'est la raison pour laquelle nous pensons que se motiver au quotidien est un moyen de se recharger pour acommlir encore plus de choses', './storage/disk/realisations/realisatio_345837.jpg', '<p>Nous n\'avons pas tout le temps le moral √† 100%. C\'est la raison pour laquelle nous pensons que se motiver au quotidien est un moyen de se recharger pour acommlir encore plus de choses<br></p>', 12, 7, 1, 1, '2022-04-06 08:06:03', '2022-12-10 01:55:12'),
