(4, 'R√©alisations de visuels pour le compte de CABRO ENTREPRISE', 'realisations-de-visuels-pour-le-compte-de-cabro-entreprise', 'Dans le but de communiquer sur  son entreprise et son r√©seau social, Cabro Entreprise nous a sollicit√© afin de r√©aliser pour eux quelques visuels', './storage/disk/realisations/realisatio_343289.jpg', '<p>Dans le but de communiquer sur&nbsp; son entreprise et son r√©seau social, Cabro Entreprise nous a sollicit√© afin de r√©aliser pour eux quelques visuels<br></p>', 32, 7, 1, 1, '2022-04-06 10:46:38', '2022-11-19 20:06:21'),
